ypeof timeLocations !== \"undefined\" &&\n        timeLocations.length === 1\n      );\n    }\n  }\n\n  return false;\n}\nexport function isLectureWithSections(enrollCode, sections) {\n  // Find the section with the given enrollCode\n  const section = sections.find(\n    (section) => section.section.enrollCode === enrollCode,\n  );\n\n  if (section) {\n    // Extract the courseId and section number from the found section\n    const courseId = section.courseInfo.courseId;\n    const sectionNumberEnd = section.section.section.slice(2);\n\n    if (sectionNumberEnd === \"00\") {\n      // Filter all sections with the same courseId\n      // Stryker disable all\n      const courseSections = sections.filter(\n        (section) => section.courseInfo.courseId === courseId,\n      );\n      // Stryker restore all\n      // Check if there is only one section for the course\n      return courseSections.length > 1;\n    }\n  }\n\n  return false;\n}\n\nexport const objectToAxiosParams = (data) => {\n  return {\n    url: \"/api/courses/post\",\n    method: \"POST\",\n    params: {\n      enrollCd: data.enrollCd.toString(),\n      psId: data.psId.toString(),\n    },\n  };\n};\n\nexport const handleAddToSchedule = (section, schedule, mutation) => {\n  // Execute the mutation with the provided data\n  const dataFinal = {\n    enrollCd: section.section.enrollCode,\n    psId: schedule,\n  };\n  mutation.mutate(dataFinal);\n};\n\nexport const handleLectureAddToSchedule = (section, schedule, mutation) => {\n  // Execute the mutation with the provided data\n  console.log(section);\n  const dataFinal = {\n    enrollCd: section,\n    psId: schedule,\n  };\n  console.log(dataFinal);\n  mutation.mutate(dataFinal);\n};\n\nexport const onSuccess = (response) => {\n  if (response.length <"+" 3) {\n    toast(\n      `New course Created - id: ${response[0].id} enrollCd: ${response[0].enrollCd}`,\n    );\n  } else {\n    toast(\n      `Course ${response[0].enrollCd} replaced old section ${response ctions(enrollCode, sections);\n\n    expect(result).toBe(true);\n  });\n\n  it(\"should return false when the section is not a lecture\", () => {\n    const enrollCode = \"12345\";\n    const sections = [\n      {\n        courseInfo: { courseId: \"COURSE1\" },\n        section: { enrollCode: \"12345\", section: \"0101\" },\n      },\n    ];\n\n    const result = isLectureWithNoSections(enrollCode, sections);\n\n    expect(result).toBe(false);\n  });\n\n  it(\"should return false when the section is a lecture but there are other sections\", () => {\n    const enrollCode = \"12345\";\n    const sections = [\n      {\n        courseInfo: { courseId: \"COURSE1\" },\n        section: { enrollCode: \"12345\", section: \"0100\" },\n      },\n      {\n        courseInfo: { courseId: \"COURSE1\" },\n        section: { enrollCode: \"67890\", section: \"0101\" },\n      },\n    ];\n\n    const result = isLectureWithNoSections(enrollCode, sections);\n\n    expect(result).toBe(false);\n  });\n\n  it(\"should return false when the section is not found\", () => {\n    const enrollCode = \"12345\";\n    const sections = [\n      {\n        courseInfo: { courseId: \"COURSE1 -1\" },\n        section: { enrollCode: \"67890\", section: \"0100\" },\n      },\n      {\n        courseInfo: { courseId: \"COURSE1 -2\" },\n        section: { enrollCode: \"67891\", section: \"0200\" },\n      },\n    ];\n\n    const result = isLectureWithNoSections(enrollCode, sections);\n\n    expect(result).toBe(false);\n  });\n  it(\"should return true when the section number ends in 00 and is not 0100 and has a location\", () => {\n    const enrollCode = \"12345\";\n    const sections = [\n      {\n        courseInfo: { courseId: \"COURSE1 -1\" },\n        section: {\n          enrollCode: \"12345\",\n          section: \"22200\",\n          timeLocations: [\n            {\n              room: \"3505\",\n              building: \"PHELP\",\n              roomCapacity: \"60\",\n              days: \" T R   \",\n              beginTime: \"08:00\",\n              endTime: \"09:15\",\n            },\n          ],\n        },\n      },\n      {\n        courseInfo: { courseId: \"COURSE1 -2\" },\n        section: {\n          enrollCode: \"12345\",\n          section: \"22201\",\n          timeLocations: [\n            {\n              room: \"3505\",\n              building: \"PHELP\",\n              roomCapacity: \"60\",\n              days: \" T R   \",\n              beginTime: \"08:00\",\n              endTime: \"09:15\",\n            },\n          ],\n        },\n      },\n    ];\n\n    const result = isLectureWithNoSections(enrollCode, sections);\n\n    expect(result).toBe(true);\n  });\n  it(\"should return false when the section number ends in 00 and is not 0100 and does not have a location\", () => {\n    const enrollCode = \"12345\";\n    const sections = [\n      {\n        courseInfo: { courseId: \"COURSE1\" },\n        section: {\n          enrollCode: \"12345\",\n          section: \"0200\",\n        },\n      },\n    ];\n\n    const result = isLectureWithNoSections(enrollCode, sections);\n\n    expect(result).toBe(false);\n  });\n  it(\"should return false when the section number does not end in 00\", () => {\n    const enrollCode = \"12345\";\n    const sections = [\n      {\n        courseInfo: { courseId: \"COURSE1\" },\n        section: {\n          enrollCode: \"12345\",\n          section: \"0201\",\n          timeLocations: [\n            {\n              room: \"3505\",\n              building: \"PHELP\",\n              roomCapacity: \"60\",\n              days: \" T R   \",\n              beginTime: \"08:00\",\n              endTime: \"09:15\",\n            },\n          ],\n        },\n      },\n    ];\n\n    const result = isLectureWithNoSections(enrollCode, sections);\n\n    expect(result).toBe(false);\n  });\n  it(\"should return false when the section number ends in 00 and is not 0100 and has a section\", () => {\n    const enrollCode = \"12345\";\n    const sections = [\n      {\n        courseInfo: { courseId: \"COURSE1\" },\n        section: {\n          enrollCode: \"12345\",\n          section: \"0200\",\n          timeLocations: [\n            {\n              room: \"3505\",\n              building: \"PHELP\",\n              roomCapacity: \"60\",\n              days: \" T R   \",\n              beginTime: \"08:00\",\n              endTime: \"09:15\",\n            },\n          ],\n        },\n      },\n      {\n        courseInfo: { courseId: \"COURSE1\" },\n        section: {\n          enrollCode: \"12346\",\n          section: \"0201\",\n          timeLocations: [\n            {\n              room: \"3505\",\n              building: \"PHELP\",\n              roomCapacity: \"60\",\n              days: \" T R   \",\n              beginTime: \"08:00\",\n              endTime: \"09:15\",\n            },\n          ],\n        },\n      },\n    ];\n\n    const result = isLectureWithNoSections(enrollCode, sections);\n\n    expect(result).toBe(false);\n  });\n  it(\"should return false when the section number ends in 00 and is not 0100 and has time locations not equal to one\", () => {\n    const enrollCode = \"12345\";\n    const sections = [\n      {\n        courseInfo: { courseId: \"COURSE1\" },\n        section: {\n          enrollCode: \"12345\",\n          section: \"0200\",\n          timeLocations: [],\n        },\n      },\n    ];\n\n    const result = isLectureWithNoSections(enrollCode, sections);\n\n    expect(result).toBe(false);\n  });\n});\n\ndescribe(\"isLectureWithSections\", () => {\n  it(\"should return false when the section is a lecture with no other sections\", () => {\n    const enrollCode = \"12345\";\n    const sections = [\n      {\n        courseInfo: { courseId: \"COURSE1\" },\n        section: { enrollCode: \"12345\", section: \"0100\" },\n      },\n    ];\n\n    const result = isLectureWithSections(enrollCode, sections);\n\n    expect(result).toBe(false);\n  });\n\n  it(\"should return false when the section is not a lecture\", () => {\n    const enrollCode = \"12345\";\n    const sections = [\n      {\n        courseInfo: { courseId: \"COURSE1\" },\n        section: { enrollCode: \"12345\", section: \"0101\" },\n      },\n    ];\n\n    const result = isLectureWithSections(enrollCode, sections);\n\n    expect(result).toBe(false);\n  });\n\n  it(\"should return true when the section is a lecture but there are other sections\", () => {\n    const enrollCode = \"12345\";\n    const sections = [\n      {\n        courseInfo: { courseId: \"COURSE1\" },\n        section: { enrollCode: \"12345\", section: \"0100\" },\n      },\n      {\n        courseInfo: { courseId: \"COURSE1\" },\n        section: { enrollCode: \"67890\", section: \"0101\" },\n      },\n    ];\n\n    const result = isLectureWithSections(enrollCode, sections);\n\n    expect(result).toBe(true);\n  });\n\n  it(\"should return false when the section is not found\", () => {\n    const enrollCode = \"12345\";\n    const sections = [\n      {\n        courseInfo: { courseId: \"COURSE1\" },\n        section: { enrollCode: \"67890\", section: \"0100\" },\n      },\n      {\n        courseInfo: { courseId: \"COURSE1\" },\n        section: { enrollCode: \"67891\", section: \"0100\" },\n      },\n    ];\n\n    const result = isLectureWithSections(enrollCode, sections);\n\n    expect(result).toBe(false);\n  });\n  it(\"should return false when section number does not end with '00'\", () => {\n    const enrollCode = \"12345\";\n    const sections = [\n      {\n        courseInfo: { courseId: \"COURSE1\" },\n        section: { enrollCode: \"12345\", section: \"0101\" },\n      },\n      {\n        courseInfo: { courseId: \"COURSE1\" },\n        section: { enrollCode: \"12346\", section: \"0102\" },\n      },\n    ];\n\n    const result = isLectureWithSections(enrollCode, sections);\n    expect(result).toBe(false);\n  });\n  it(\"should return true when section number ends with '00' and there are multiple sections\", () => {\n    const enrollCode = \"12345\";\n    const sections = [\n      {\n        courseInfo: { courseId: \"COURSE1\" },\n        section: { enrollCode: \"12345\", section: \"0100\" },\n      },\n      {\n        courseInfo: { courseId: \"COURSE1\" },\n        section: { enrollCode: \"67890\", section: \"0100\" },\n      },\n    ];\n\n    const result = isLectureWithSections(enrollCode, sections);\n    expect(result).toBe(true);\n  });\n});\n\ndescribe(\"handleAddToSchedule\", () => {\n  it(\"calls mutate with correct data\", () => {\n    const mockMutation = { mutate: jest.fn() };\n    const mockSection = { section: { enrollCode: \"123\" } };\n    const mockSchedule = \"456\";\n\n    handleAddToSchedule(mockSection, mockSchedule, mockMutation);\n\n    expect(mockMutation.mutate).toHaveBeenCalledWith({\n      enrollCd: \"123\",\n      psId: \"456\",\n    });\n  });\n});\n\ndescribe(\"handleLectureAddToSchedule\", () => {\n  it(\"should execute the mutation with the provided data\", () => {\n    // Mock the mutation object\n    const mutationMock = {\n      mutate: jest.fn(),\n    };\n\n    // Define the input data\n    const section = 12345;\n    const schedule = \"FALL2023\";\n\n    // Call the function\n    handleLectureAddToSchedule(section, schedule, mutationMock);\n\n    // Assert that the mutation.mutate function was called with the expected data\n    expect(mutationMock.mutate).toHaveBeenCalledWith({\n      enrollCd: section,\n      psId: schedule,\n    });\n  });\n});\n\ndescribe(\"objectToAxiosParams\", () => {\n  it(\"should return the correct axios parameters\", () => {\n    const data = {\n      enrollCd: 12345,\n      psId: 15,\n    };\n\n    const result = objectToAxiosParams(data);\n\n    expect(result).toEqual({\n      url: \"/api/courses/post\",\n      method: \"POST\",\n      params: {\n        enrollCd: \"12345\",\n        psId: \"15\",\n      },\n    });\n  });\n});\n\ndescribe(\"Section tests\", () => {\n  const queryClient = new QueryClient();\n\n  test(\"calls onSuccess when mutation is successful and calls toast with correct parameters\", () => {\n    const mockMutate = jest.fn();\n    const mockMutation = { mutate: mockMutate };\n\n    useBackendMutation.mockReturnValue(mockMutation);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"SectionsTable sections={fiveSections} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    // Call the onSuccess function\n    const onSuccess = useBackendMutation.mock.calls[0][1].onSuccess;\n    const mockResponse = [{ id: 1, enrollCd: \"1234\" }];\n    onSuccess(mockResponse);\n\n    // Verify that toast was called with the correct parameters\n    expect(toast).toHaveBeenCalledWith(\n      \"New course Created - id: 1 enrollCd: 1234\",\n    );\n  });\n\n  test(\"calls onSuccess when mutation is successful for replacement and calls toasy with correct parameters\", () => {\n    const mockMutate = jest.fn();\n    const mockMutation = { mutate: mockMutate };\n\n    useBackendMutation.mockReturnValue(mockMutation);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"SectionsTable sections={fiveSections} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const onSuccess = useBackendMutation.mock.calls[0][1].onSuccess;\n    const mockResponse = [\n      { id: 1, enrollCd: \"1234\" },\n      { id: 2, enrollCd: \"5678\" },\n      { id: 3, enrollCd: \"9012\" },\n    ];\n    onSuccess(mockResponse);\n\n    expect(toast).toHaveBeenCalledWith(\n      \"Course 1234 replaced old section 9012 with new section 5678\",\n    );\n  });\n\n  test(\"calls onError when mutation throws an error and calls toast with correct parameters\", () => {\n    const mockMutate = jest.fn();\n    const mockMutation = { mutate: mockMutate };\n\n    useBackendMutation.mockReturnValue(mockMutation);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"SectionsTable sections={fiveSections} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    // Call the onSuccess function\n    const onError = useBackendMutation.mock.calls[0][1].onError;\n    const mockResponse = {\n      response: {\n        data: {\n          message: \"class exists in schedule\",\n        },\n      },\n    };\n    onError(mockResponse);\n\n    // Verify that toast was called with the correct parameters\n    expect(toast.error).toHaveBeenCalledWith(\"class exists in schedule\");\n  });\n\n  test(\"when error is received from backend, toast message error is displayed correctly\", () => {\n    const mockMutate = jest.fn();\n    const mockMutation = { mutate: mockMutate };\n\n    useBackendMutation.mockReturnValue(mockMutation);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"SectionsTable sections={fiveSections} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const onError = useBackendMutation.mock.calls[0][1].onError;\n\n    const mockError = {}; // No response or message\n    onError(mockError);\n\n    expect(toast.error).toHaveBeenCalledWith(\"An unexpected error occurred\");\n  });\n\n  test(\"onError displays default message when error.response.data is undefined\", () => {\n    const mockMutate = jest.fn();\n    const mockMutation = { mutate: mockMutate };\n\n    useBackendMutation.mockReturnValue(mockMutation);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"SectionsTable sections={fiveSections} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const onError = useBackendMutation.mock.calls[0][1].onError;\n\n    const mockError = {\n      response: {\n        data: undefined,\n      },\n    };\n\n    onError(mockError);\n\n    expect(toast.error).toHaveBeenCalledWith(\"An unexpected error occurred\");\n  });\n\n  test(\"renders without crashing for empty table\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"SectionsTable sections={[]} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n  });\n\n  test(\"Has the expected cell values when expanded\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"SectionsTable sections={fiveSections} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const expectedHeaders = [\n      \"Quarter\",\n      \"Course ID\",\n      \"Title\",\n      \"Status\",\n      \"Enrolled\",\n      \"Location\",\n      \"Days\",\n      \"Time\",\n      \"Instructor\",\n      \"Enroll Code\",\n      \"Info\",\n    ];\n    const expectedFields = [\n      \"quarter\",\n      \"courseInfo.courseId\",\n      \"Title\",\n      \"status\",\n      \"enrolled\",\n      \"location\",\n      \"days\",\n      \"time\",\n      \"instructor\",\n      \"section.enrollCode\",\n      \"info\",\n    ];\n    const testId = \"SectionsTable\";\n\n    expectedHeaders.forEach((headerText) => {\n      const header = screen.getByText(headerText);\n      expect(header).toBeInTheDocument();\n    });\n\n    expectedFields.forEach((field) => {\n      const header = screen.getByTestId(`${testId}-cell-row-0-col-${field}`);\n      expect(header).toBeInTheDocument();\n    });\n\n    const expandRow = screen.getByTestId(\n      `${testId}-cell-row-1-col-courseInfo.courseId-expand-symbols`,\n    );\n    fireEvent.click(expandRow);\n\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-quarter`),\n    ).toHaveTextContent(\"W22\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-time`),\n    ).toHaveTextContent(\"3:00 PM - 3:50 PM\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-days`),\n    ).toHaveTextContent(\"M\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-status`),\n    ).toHaveTextContent(\"Open\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-enrolled`),\n    ).toHaveTextContent(\"84/100\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-2-col-location`),\n    ).toHaveTextContent(\"HFH 1124\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-2-col-instructor`),\n    ).toHaveTextContent(\"YUNG A S\");\n  });\n\n  test(\"Has the expected column headers and content\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"SectionsTable sections={fiveSections} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const expectedHeaders = [\n      \"Quarter\",\n      \"Course ID\",\n      \"Title\",\n      \"Status\",\n      \"Enrolled\",\n      \"Location\",\n      \"Days\",\n      \"Time\",\n      \"Instructor\",\n      \"Enroll Code\",\n      \"Action\",\n    ];\n    const expectedFields = [\n      \"quarter\",\n      \"courseInfo.courseId\",\n      \"Title\",\n      \"status\",\n      \"enrolled\",\n      \"location\",\n      \"days\",\n      \"time\",\n      \"instructor\",\n      \"section.enrollCode\",\n      \"action\",\n    ];\n    const testId = \"SectionsTable\";\n\n    expectedHeaders.forEach((headerText) => {\n      const header = screen.getByText(headerText);\n      expect(header).toBeInTheDocument();\n    });\n\n    expectedFields.forEach((field) => {\n      const header = screen.getByTestId(`${testId}-cell-row-0-col-${field}`);\n      expect(header).toBeInTheDocument();\n    });\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-courseInfo.courseId`),\n    ).toHaveTextContent(\"ECE 1A\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-Title`),\n    ).toHaveTextContent(\"COMP ENGR SEMINAR\");\n    expect(\n      screen\n        .getByTestId(`${testId}-cell-row-0-col-Title`)\n        .querySelector('a[href$=\"/coursedetails/20221/12583\"]'),\n    ).toBeInTheDocument();\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-quarter`),\n    ).toHaveTextContent(\"W22\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-time`),\n    ).toHaveTextContent(\"3:00 PM - 3:50 PM\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-days`),\n    ).toHaveTextContent(\"M\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-status`),\n    ).toHaveTextContent(\"Open\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-enrolled`),\n    ).toHaveTextContent(\"84/100\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-location`),\n    ).toHaveTextContent(\"BUCHN 1930\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-instructor`),\n    ).toHaveTextContent(\"WANG L C\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-section.enrollCode`),\n    ).toHaveTextContent(\"12583\");\n    expect(screen.getByTestId(`${testId}-cell-row-0-col-action`)).toBeDefined();\n  });\n\n  test(\"Correctly groups separate lectures of the same class\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"SectionsTable sections={gigaSections} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const testId = \"SectionsTable\";\n\n    expect(\n      screen.getByTestId(`${testId}-cell-row-1-col-${colId1}-expand-symbols`),\n    ).toHaveTextContent(\"\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-2-col-${colId2}-expand-symbols`),\n    ).toHaveTextContent(\"\");\n\n    const expandRow = screen.getByTestId(\n      `${testId}-cell-row-1-col-${colId1}-expand-symbols`,\n    );\n    fireEvent.click(expandRow);\n\n    expect(\n      screen.getByTestId(`${testId}-cell-row-1-col-${colId1}-expand-symbols`),\n    ).toHaveTextContent(\"\");\n  });\n\n  test(\"First dropdown is different than last dropdown\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"SectionsTable sections={fiveSections} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const testId = \"SectionsTable\";\n\n    const expandRow = screen.getByTestId(\n      `${testId}-cell-row-1-col-courseInfo.courseId-expand-symbols`,\n    );\n    fireEvent.click(expandRow);\n\n    expect(\n      screen.getByTestId(`${testId}-cell-row-1-col-enrolled`),\n    ).toHaveTextContent(\"84/80\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-2-col-enrolled`),\n    ).toHaveTextContent(\"21/21\");\n  });\n\n  test(\"Status utility identifies each type of status\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"SectionsTable sections={fiveSections} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const testId = \"SectionsTable\";\n\n    const expandRow = screen.getByTestId(\n      `${testId}-cell-row-1-col-courseInfo.courseId-expand-symbols`,\n    );\n    fireEvent.click(expandRow);\n\n    expect(\n      screen.getByTestId(`${testId}-cell-row-1-col-status`),\n    ).toHaveTextContent(\"Closed\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-2-col-status`),\n    ).toHaveTextContent(\"Full\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-3-col-status`),\n    ).toHaveTextContent(\"Cancelled\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-4-col-status`),\n    ).toHaveTextContent(\"Open\");\n  });\n\n  test(\"Info link is correct\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"SectionsTable sections={fiveSections} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const testId = \"SectionsTable\";\ 2625\"]'),\n    ).toBeInTheDocument();\n  });\n});\n"},"src/tests/components/Sections/SectionsInstructorTable.test.js":{"tests":[{"id":"23","name":"Section tests renders without crashing for empty table","location":{"start":{"column":4,"line":17}}},{"id":"25","name":"Section tests Has the expected column headers and content","location":{"start":{"column":4,"line":98}}},{"id":"27","name":"Section tests First dropdown is different than last dropdown","location":{"start":{"column":4,"line":177}}},{"id":"28","name":"Section tests Status utility identifies each type of status","location":{"start":{"column":4,"line":196}}},{"id":"75","name":"Section tests Has the expected cell values","location":{"start":{"column":4,"line":27}}},{"id":"76","name":"Section tests Each column has disableGroupBy set to true","location":{"start":{"column":4,"line":221}}}],"source":"import { render, screen } from \"@testing-library/react\";\nimport { fiveSections, sixSections } from \"fixtures/sectionOverTimeFixtures\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\nimport SectionsInstructorTable from \"main/components/Sections/SectionsInstructorTable\";\n\nconst mockedNavigate = jest.fn();\n\njest.mock(\"react-router-dom\", () => ({\n  ...jest.requireActual(\"react-router-dom\"),\n  useNavigate: () => mockedNavigate,\n}));\n\ndescribe(\"Section tests\", () => {\n  const queryClient = new QueryClient();\n\n  test(\"renders without crashing for empty table\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"SectionsInstructorTable sections={[]} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n  });\n\n  test(\"Has the expected cell values\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"SectionsInstructorTable sections={sixSections} />\n        <"+"/MemoryRouter>\n ment();\n    expect(\n      screen\n        .getByTestId(`${testId}-cell-row-2-col-info`)\n        .querySelector('a[href$=\"/coursedetails/20221/12609\"]'),\n    ).toBeInTheDocument();\n    expect(\n      screen\n        .getByTestId(`${testId}-cell-row-3-col-info`)\n        .querySelector('a[href$=\"/coursedetails/20221/12617\"]'),\n    ).toBeInTheDocument();\n    expect(\n      screen\n        .getByTestId(`${testId}-cell-row-4-col-info`)\n        .querySelector('a[href$=\"/coursedetails/20221/12625\"]'),\n    ).toBeInTheDocument();\n  });\n\n  test(\"Course ID's are correct\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"SectionsOverTimeTable sections={fiveSections} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    const testId = \"SectionsOverTimeTable\";\n\n    const expandRow = screen.getByTestId(\n      `${testId}-cell-row-1-col-quarter-expand-symbols`,\n    );\n    fireEvent.click(expandRow);\n\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-courseInfo.courseId`),\n    ).toHaveTextContent(\"ECE 5\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-1-col-courseInfo.courseId`),\n    ).toHaveTextContent(\"ECE 5\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-2-col-courseInfo.courseId`),\n    ).toHaveTextContent(\"ECE 5\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-3-col-courseInfo.courseId`),\n    ).toHaveTextContent(\"ECE 5\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-4-col-courseInfo.courseId`),\n    ).toHaveTextContent(\"ECE 5\");\n  });\n});\n"},"src/tests/pages/AdminJobsPage.test.js":{"tests":[{"id":"31","name":"AdminJobsPage tests renders without crashing","location":{"start":{"column":4,"line":55}}},{"id":"32","name":"AdminJobsPage tests user can submit a test job","location":{"start":{"column":4,"line":89}}},{"id":"33","name":"AdminJobsPage tests user can submit the update cours .reply(200, systemInfoFixtures.showingNeither);\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.adminUser);\n    axiosMock.onGet(/\\/api\\/jobs\\/paginated.*/).reply((config) => {\n      let page = 0;\n      let pageSize = 10;\n      if (config.params && config.params.page !== undefined) {\n        page = Number(config.params.page);\n      }\n      if (config.params && config.params.pageSize !== undefined) {\n        pageSize = Number(config.params.pageSize);\n      }\n      // Calculate totalPages based on jobsFixtures.sixJobs.length and pageSize\n      const totalElements = jobsFixtures.sixJobs.length;\n      const totalPages = Math.ceil(totalElements / pageSize);\n\n      return [\n        200,\n        {\n          content: jobsFixtures.sixJobs,\n          totalPages,\n          number: page,\n          size: pageSize,\n          totalElements,\n        },\n      ];\n    });\n    axiosMock.onGet(\"/api/UCSBSubjects/all\").reply(200, allTheSubjects);\n  });\n\n  test(\"renders without crashing\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminJobsPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    expect(await screen.findByText(\"Launch Jobs\")).toBeInTheDocument();\n    expect(await screen.findByText(\"Job Status\")).toBeInTheDocument();\n\n    [\"Test Job\", \"Update Courses Database\", \"Update Grade Info\"].map(\n      (jobName) => expect(screen.getByText(jobName)).toBeInTheDocument(),\n    );\n\n    const testId = \"JobsTable\";\n\n    expect(screen.getByTestId(`${testId}-cell-row-0-col-id`)).toHaveTextContent(\n      \"1\",\n    );\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-Created`),\n    ).toHaveTextContent(\"1\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-Updated`),\n    ).toHaveTextContent(\"11/13/2022, 19:49:59\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-status`),\n    ).toHaveTextContent(\"complete\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-Log`),\n    ).toHaveTextContent(\"Hello World! from test job! Goodbye from test job!\");\n  });\n\n  test(\"user can submit a test job\", async () => {\n    axiosMock\n      .onPost(\"/api/jobs/launch/testjob?fail=false&sleepMs=0\")\n      .reply(200, {});\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminJobsPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(await screen.findByText(\"Test Job\")).toBeInTheDocument();\n\n    const testJobButton = screen.getByText(\"Test Job\");\n    expect(testJobButton).toBeInTheDocument();\n    testJobButton.click();\n\n    expect(await screen.findByTestId(\"TestJobForm-fail\")).toBeInTheDocument();\n\n    const sleepMsInput = screen.getByTestId(\"TestJobForm-sleepMs\");\n    const submitButton = screen.getByTestId(\"TestJobForm-Submit-Button\");\n\n    expect(sleepMsInput).toBeInTheDocument();\n    expect(submitButton).toBeInTheDocument();\n\n    fireEvent.change(sleepMsInput, { target: { value: \"0\" } });\n    submitButton.click();\n\n    await waitFor(() => expect(axiosMock.history.post.length).toBe(1));\n\n    expect(axiosMock.history.post[0].url).toBe(\n      \"/api/jobs/launch/testjob?fail=false&sleepMs=0\",\n    );\n  });\n\n  test(\"user can submit the update course data job\", async () => {\n    axiosMock\n      .onPost(\n        \"/api/jobs/launch/updateCourses?quarterYYYYQ=20211&subjectArea=ANTH&ifStale=true\",\n      )\n      .reply(200, {});\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminJobsPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(\n      await screen.findByText(\"Update Courses Database\"),\n    ).toBeInTheDocument();\n\n    const updateCoursesButton = screen.getByText(\"Update Courses Database\");\n    expect(updateCoursesButton).toBeInTheDocument();\n    updateCoursesButton.click();\n\n    expect(await screen.findByTestId(\"updateCourses\")).toBeInTheDocument();\n    const submitButton = screen.getByTestId(\"updateCourses\");\n\n    const expectedKey = \"UpdateCoursesJobForm.Subject-option-ANTH\";\n    await waitFor(() =>\n      expect(screen.getByTestId(expectedKey).toBeInTheDocument),\n    );\n\n    const selectQuarter = screen.getByTestId(\"UpdateCoursesJobForm.Quarter\");\n    userEvent.selectOptions(selectQuarter, \"20211\");\n    const selectSubject = screen.getByLabelText(\"Subject Area\");\n    expect(selectSubject).toBeInTheDocument();\n    userEvent.selectOptions(selectSubject, \"ANTH\");\n\n    expect(submitButton).toBeInTheDocument();\n\n    submitButton.click();\n\n    await waitFor(() => expect(axiosMock.history.post.length).toBe(1));\n\n    expect(axiosMock.history.post[0].url).toBe(\n      \"/api/jobs/launch/updateCourses?quarterYYYYQ=20211&subjectArea=ANTH&ifStale=true\",\n    );\n  });\n\n  test(\"user can submit the update course data by quarter job\", async () => {\n    const url =\n      \"/api/jobs/launch/updateQuarterCourses?quarterYYYYQ=20222&ifStale=true\";\n    axiosMock.onPost(url).reply(200, {});\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminJobsPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(\n      await screen.findByText(\"Update Courses Database by quarter\"),\n    ).toBeInTheDocument();\n\n    const updateCoursesButton = screen.getByText(\n      \"Update Courses Database by quarter\",\n    );\n    expect(updateCoursesButton).toBeInTheDocument();\n    updateCoursesButton.click();\n\n    const submitButton = screen.getByTestId(\"updateCoursesByQuarter\");\n    expect(\n      await screen.findByTestId(\"updateCoursesByQuarter\"),\n    ).toBeInTheDocument();\n\n    const selectQuarter = screen.getByTestId(\n      \"UpdateCoursesByQuarterJobForm.Quarter\",\n    );\n    userEvent.selectOptions(selectQuarter, \"20222\");\n    expect(submitButton).toBeInTheDocument();\n\n    submitButton.click();\n\n    await waitFor(() => expect(axiosMock.history.post.length).toBe(1));\n\n    expect(axiosMock.history.post[0].url).toBe(url);\n  });\n\n  test(\"user can submit the update course data by quarter range job\", async () => {\n    const url =\n      \"/api/jobs/launch/updateCoursesRangeOfQuarters?start_quarterYYYYQ=20212&end_quarterYYYYQ=20213&ifStale=true\";\n    axiosMock.onPost(url).reply(200, {});\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminJobsPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(\n      await screen.findByText(\"Update Courses Database by quarter range\"),\n    ).toBeInTheDocument();\n\n    const updateCoursesButton = screen.getByText(\n      \"Update Courses Database by quarter range\",\n    );\n    expect(updateCoursesButton).toBeInTheDocument();\n    updateCoursesButton.click();\n\n    const submitButton = screen.getByTestId(\"updateCoursesByQuarterRange\");\n    expect(\n      await screen.findByTestId(\"updateCoursesByQuarterRange\"),\n    ).toBeInTheDocument();\n\n    const selectStartQuarter = screen.getByLabelText(\"Start Quarter\");\n    userEvent.selectOptions(selectStartQuarter, \"20212\");\n    const selectEndQuarter = screen.getByLabelText(\"End Quarter\");\n    userEvent.selectOptions(selectEndQuarter, \"20213\");\n    expect(submitButton).toBeInTheDocument();\n\n    submitButton.click();\n\n    await waitFor(() => expect(axiosMock.history.post.length).toBe(1));\n\n    expect(axiosMock.history.post[0].url).toBe(url);\n  });\n\n  test(\"user can submit update grade info\", async () => {\n    const url = \"/api/jobs/launch/uploadGradeData\";\n    axiosMock.onPost(url).reply(200, {});\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminJobsPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(await screen.findByText(\"Update Grade Info\")).toBeInTheDocument();\n\n    const dropDownButton = screen.getByText(\"Update Grade Info\");\n    expect(dropDownButton).toBeInTheDocument();\n    dropDownButton.click();\n\n    const updateGradeButton = screen.getByText(\"Update Grades\");\n    expect(updateGradeButton).toBeInTheDocument();\n    updateGradeButton.click();\n\n    await waitFor(() => expect(axiosMock.history.post.length).toBe(1));\n    expect(axiosMock.history.post[0].url).toBe(url);\n  });\n\n  test(\"user can purge all jobs in the JobsTable\", async () => {\n    axiosMock.onDelete(\"/api/jobs/all\").reply(200, {});\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminJobsPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(await screen.findByText(\"Purge Job Log\")).toBeInTheDocument();\n\n    const purgeAllLogsButton = screen.getByText(\"Purge Job Log\");\n    expect(purgeAllLogsButton).toBeInTheDocument();\n    purgeAllLogsButton.click();\n\n    await waitFor(() => expect(axiosMock.history.delete.length).toBe(1));\n\n    expect(axiosMock.history.delete[0].url).toBe(\"/api/jobs/all\");\n  });\n\n  test(\"AdminJobsPage uses correct localStorage keys for search form\", async () => {\n    const setItemSpy = jest.spyOn(Storage.prototype, \"setItem\");\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminJobsPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await screen.findByText(\"Job Status\");\n\n    // Simulate user changing dropdowns\n    userEvent.selectOptions(screen.getByLabelText(\"Sort By\"), \"updatedAt\");\n    userEvent.selectOptions(screen.getByLabelText(\"Sort Direction\"), \"DESC\");\n    userEvent.selectOptions(screen.getByLabelText(\"Page Size\"), \"20\");\n\n    expect(setItemSpy).toHaveBeenCalledWith(\n      \"JobsSearch.SortField\",\n      \"updatedAt\",\n    );\n    expect(setItemSpy).toHaveBeenCalledWith(\"JobsSearch.SortDirection\", \"DESC\");\n    expect(setItemSpy).toHaveBeenCalledWith(\"JobsSearch.PageSize\", \"20\");\n  });\n\n  test(\"AdminJobsPage renders spacing divs with correct margin styles\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminJobsPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const divs = document.querySelectorAll(\"div\");\n    const hasMarginTopDiv = Array.from(divs).some(\n      (div) => div.style && div.style.marginTop === \"1rem\",\n    );\n    expect(hasMarginTopDiv).toBe(true);\n\n    const hasMarginBottomDiv = Array.from(divs).some(\n      (div) => div.style && div.style.marginBottom === \"1rem\",\n    );\n    expect(hasMarginBottomDiv).toBe(true);\n  });\n\n  test(\"When localstorage is empty, fallback values are used\", async () => {\n    jest.spyOn(Storage.prototype, \"getItem\").mockImplementation(() => null);\n\n    const setItemSpy = jest.spyOn(Storage.prototype, \"setItem\");\n\n    const useLocalStorageSpy = jest.spyOn(\n      require(\"main/utils/useLocalStorage\"),\n      \"default\",\n    );\n\n    axiosMock.onGet(\"/api/jobs/paginated\").reply(200, {\n      content: jobsFixtures.sixJobs,\n      totalPages: 3,\n      number: 0,\n      size: 10,\n      totalElements: jobsFixtures.sixJobs.length,\n    });\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminJobsPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(await screen.findByText(\"Launch Jobs\")).toBeInTheDocument();\n    expect(await screen.findByText(\"Job Status\")).toBeInTheDocument();\n\n    expect(setItemSpy).toHaveBeenCalledWith(\"JobsSearch.SortField\", \"status\");\n    expect(setItemSpy).toHaveBeenCalledWith(\"JobsSearch.SortDirection\", \"ASC\");\n    expect(setItemSpy).toHaveBeenCalledWith(\"JobsSearch.PageSize\", \"5\");\n\n    const calls = useLocalStorageSpy.mock.calls;\n    let counts = {};\n    for (const call of calls) {\n      const key = `${call[0]},${call[1]}`;\n      counts[key] = counts[key] ? counts[key] + 1 : 1;\n    }\n\n    expect(counts).toEqual({\n      \"JobsSearch.PageSize,5\": 6,\n      \"JobsSearch.SortDirection,ASC\": 6,\n      \"JobsSearch.SortField,status\": 6,\n    });\n\n    expect(axiosMock.history.get.length).toBe(4);\n    const urls = axiosMock.history.get.map((req) => req.url);\n    expect(urls).toContain(\"/api/systemInfo\");\n    expect(urls).toContain(\"/api/UCSBSubjects/all\");\n    expect(urls).toContain(\"/api/currentUser\");\n    expect(urls).toContain(\"/api/jobs/paginated\");\n\n    const updatesRequest = axiosMock.history.get.find(\n      (req) => req.url && req.url.includes(\"/api/jobs/paginated\"),\n    );\n    expect(updatesRequest.params).toEqual({\n      page: 0,\n      pageSize: 5,\n      sortField: \"status\",\n      sortDirection: \"ASC\",\n    });\n\n    expect(screen.getByTestId(\"OurPagination-1\")).toBeInTheDocument();\n    expect(screen.getByTestId(\"OurPagination-2\")).toBeInTheDocument();\n\n    expect(screen.queryByTestId(\"OurPagination-3\")).not.toBeInTheDocument();\n\n    const page2 = await screen.findByTestId(\"OurPagination-2\");\n    await waitFor(() => {\n      const lastRequest = axiosMock.history.get\n        .filter((req) => req.url && req.url.includes(\"/api/jobs/paginated\"))\n        .pop();\n      expect(lastRequest.params.page).toBe(0); // or whatever the expected page is\n    });\n    userEvent.click(page2);\n    await waitFor(() => {\n      const lastRequest = axiosMock.history.get\n        .filter((req) => req.url && req.url.includes(\"/api/jobs/paginated\"))\n        .pop();\n      expect(lastRequest.params.page).toBe(1); // or whatever the expected page is\n    });\n\n    userEvent.selectOptions(screen.getByLabelText(\"Page Size\"), \"10\");\n\n    await waitFor(() => {\n      const lastRequest = axiosMock.history.get\n        .filter((req) => req.url && req.url.includes(\"/api/jobs/paginated\"))\n        .pop();\n\n      expect(lastRequest.params.page).toBe(0); // or whatever the expected page is\n    });\n  });\n});\n"},"src/tests/components/BasicCourseSearch/CourseOverTimeSearchForm.test.js":{"tests":[{"id":"41","name":"CourseOverTimeSearchForm tests renders without crashing","location":{"start":{"column":4,"line":66}}},{"id":"42","name":"CourseOverTimeSearchForm tests when I select an end quarter, the state for end quarter changes","location":{"start":{"column":4,"line":76}}},{"id":"43","name":"CourseOverTimeSearchForm tests when I select a subject, the state for subject changes","location":{"start":{"column":4,"line":89}}},{"id":"44","name":"CourseOverTimeSearchForm tests when I select a course number without suffix, the state for course number changes","location":{"start":{"column":4,"line":111}}},{"id":"45","name":"CourseOverTimeSearchForm tests when I select a course number with suffix, the state for course number changes","location":{"start":{"column":4,"line":126}}},{"id":"46","name":"CourseOverTimeSearchForm tests when I select a course number without number, the state for course number changes","location":{"start":{"column":4,"line":141}}},{"id":"47","name":"CourseOverTimeSearchForm tests when I click submit, the right stuff happens","location":{"start":{"column":4,"line":156}}},{"id":"48","name":"CourseOverTimeSearchForm tests when I click submit when JSON is EMPTY, setCourse is not called!","location":{"start":{"column":4,"line":207}}},{"id":"49","name":"CourseOverTimeSearchForm tests renders without crashing when fallback values are used","location":{"start":{"column":4,"line":244}}},{"id":"50","name":"CourseOverTimeSearchForm tests when I select a course number with the course area too, the course number just retains the number","location":{"start":{"column":4,"line":268}}},{"id":"51","name":"CourseOverTimeSearchForm tests when I select a course number with the course area too (lowercase), the course number just retains the number","location":{"start":{"column":4,"line":297}}},{"id":"52","name":"CourseOverTimeSearchForm tests when I select a course number with the course area too (except cs), the course number just retains the number","location":{"start":{"column":4,"line":325}}},{"id":"53","name":"CourseOverTimeSearchForm tests when I select a course number with the course area too (random casing), the course number just retains the number","location":{"start":{"column":4,"line":353}}},{"id":"54","name":"CourseOverTimeSearchForm tests when I select a course number with lowercase suffix, it still gives the correct output","location":{"start":{"column":4,"line":381}}},{"id":"55","name":"CourseOverTimeSearchForm tests when I select a course number with the just number, the course number just retains the number","location":{"start":{"column":4,"line":409}}}],"source":"import React from \"react\";\nimport { render, screen, waitFor, cleanup } from \"@testing-library/react\";\nimport userEvent from \"@testing-library/user-event\";\nimport { toast } from \"react-toastify\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\nimport { allTheSubjects } from \"fixtures/subjectFixtures\";\nimport SectionsOverTimeTable from \"main/components/Sections/SectionsOverTimeTable\";\n\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\n\nimport CourseOverTimeSearchForm from \"main/components/BasicCourseSearch/CourseOverTimeSearchForm\";\n\njest.mock(\"react-toastify\", () => ({\n  toast: jest.fn(),\n}));\n\ndescribe(\"CourseOverTimeSearchForm tests\", () => {\n  const axiosMock = new AxiosMockAdapter(axios);\n  const queryClient = new QueryClient();\n  const addToast = jest.fn();\n\n  const mockSections = [\n    {\n      courseInfo: {\n        quarter: \"20231\",\n        courseId: \"CMPSC156\",\n        title: \"Advanced Applications Programming\",\n      },\n      section: {\n        section: \"0100\",\n        enrolledTotal: 30,\n        maxEnroll: 50,\n        timeLocations: [],\n        instructors: [],\n        enrollCode: \"12345\",\n      },\n    },\n  ];\n\n  beforeEach(() => {\n    jest.clearAllMocks();\n    jest.spyOn(console, \"error\").mockImplementation(() => null);\n\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.userOnly);\n    axiosMock.onGet(\"/api/systemInfo\").reply(200, {\n      ...systemInfoFixtures.showingNeither,\n      startQtrYYYYQ: \"20201\",\n      endQtrYYYYQ: \"20214\",\n    });\n\n    toast.mockReturnValue({\n      addToast: addToast,\n    });\n  });\n\n  afterEach(() => {\n    cleanup();\n  });\n\n  test(\"renders without crashing\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeSearchForm />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n  });\n\n  test(\"when I select an end quarter, the state for end quarter changes\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeSearchForm />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    const selectEndQuarter = screen.getByLabelText(\"End Quarter\");\n    userEvent.selectOptions(selectEndQuarter, \"20204\");\n    expect(selectEndQuarter.value).toBe(\"20204\");\n  });\n\n  test(\"when I select a subject, the state for subject changes\", async () => {\n    axiosMock.onGet(\"/api/UCSBSubjects/all\").reply(200, allTheSubjects);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeSearchForm />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const expectedKey = await screen.findByTestId(\n      \"CourseOverTimeSearch.Subject-option-MATH\",\n    );\n    expect(expectedKey).toBeInTheDocument();\n\n    const selectSubject = screen.getByLabelText(\"Subject Area\");\n    userEvent.selectOptions(selectSubject, \"MATH\");\n\n    expect(selectSubject.value).toBe(\"MATH\");\n  });\n\n  test(\"when I select a course number without suffix, the state for course number changes\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeSearchForm />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    const selectCourseNumber = screen.getByLabelText(\n      \"Course Number (Try searching '16' or '130A')\",\n    );\n    userEvent.type(selectCourseNumber, \"24\");\n    expect(selectCourseNumber.value).toBe(\"24\");\n  });\n\n  test(\"when I select a course number with suffix, the state for course number changes\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeSearchForm />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    const selectCourseNumber = screen.getByLabelText(\n      \"Course Number (Try searching '16' or '130A')\",\n    );\n    userEvent.type(selectCourseNumber, \"130A\");\n    expect(selectCourseNumber.value).toBe(\"130A\");\n  });\n\n  test(\"when I select a course number without number, the state for course number changes\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeSearchForm />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    const selectCourseNumber = screen.getByLabelText(\n      \"Course Number (Try searching '16' or '130A')\",\n    );\n    userEvent.type(selectCourseNumber, \"A\");\n    expect(selectCourseNumber.value).toBe(\"A\");\n  });\n\n  test(\"when I click submit, the right stuff happens\", async () => {\n    axiosMock.onGet(\"/api/UCSBSubjects/all\").reply(200, allTheSubjects);\n    const sampleReturnValue = {\n      sampleKey: \"sampleValue\",\n    };\n\n    const fetchJSONSpy = jest.fn().mockResolvedValue(sampleReturnValue);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeSearchForm fetchJSON={fetchJSONSpy} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const expectedFields = {\n      startQuarter: \"20211\",\n      endQuarter: \"20214\",\n      subject: \"CMPSC\",\n      courseNumber: \"130\",\n      courseSuf: \"A\",\n    };\n\n    const expectedKey = await screen.findByTestId(\n      \"CourseOverTimeSearch.Subject-option-CMPSC\",\n    );\n    expect(expectedKey).toBeInTheDocument();\n\n    const selectStartQuarter = screen.getByLabelText(\"Start Quarter\");\n    userEvent.selectOptions(selectStartQuarter, \"20211\");\n    const selectEndQuarter = screen.getByLabelText(\"End Quarter\");\n    userEvent.selectOptions(selectEndQuarter, \"20214\");\n    const selectSubject = screen.getByLabelText(\"Subject Area\");\n    expect(selectSubject).toBeInTheDocument();\n    userEvent.selectOptions(selectSubject, \"CMPSC\");\n    const selectCourseNumber = screen.getByLabelText(\n      \"Course Number (Try searching '16' or '130A')\",\n    );\n    userEvent.type(selectCourseNumber, \"130A\");\n    const submitButton = screen.getByText(\"Submit\");\n    userEvent.click(submitButton);\n\n    await waitFor(() => expect(fetchJSONSpy).toHaveBeenCalledTimes(1));\n\n    expect(fetchJSONSpy).toHaveBeenCalledWith(\n      expect.any(Object),\n      expectedFields,\n    );\n  });\n\n  test(\"when I click submit when JSON is EMPTY, setCourse is not called!\", async () => {\n    axiosMock.onGet(\"/api/UCSBSubjects/all\").reply(200, allTheSubjects);\n\n    const sampleReturnValue = {\n      sampleKey: \"sampleValue\",\n      total: 0,\n    };\n\n    const fetchJSONSpy = jest.fn().mockResolvedValue(sampleReturnValue);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeSearchForm fetchJSON={fetchJSONSpy} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const expectedKey = await screen.findByTestId(\n      \"CourseOverTimeSearch.Subject-option-CMPSC\",\n    );\n    expect(expectedKey).toBeInTheDocument();\n\n    const selectStartQuarter = screen.getByLabelText(\"Start Quarter\");\n    userEvent.selectOptions(selectStartQuarter, \"20204\");\n    const selectEndQuarter = screen.getByLabelText(\"End Quarter\");\n    userEvent.selectOptions(selectEndQuarter, \"20204\");\n    const selectSubject = screen.getByLabelText(\"Subject Area\");\n    userEvent.selectOptions(selectSubject, \"CMPSC\");\n    const selectCourseNumber = screen.getByLabelText(\n      \"Course Number (Try searching '16' or '130A')\",\n    );\n    userEvent.type(selectCourseNumber, \"130A\");\n    const submitButton = screen.getByText(\"Submit\");\n    userEvent.click(submitButton);\n  });\n\n  test(\"renders without crashing when fallback values are used\", async () => {\n    axiosMock.onGet(\"/api/systemInfo\").reply(200, {\n      springH2ConsoleEnabled: false,\n      showSwaggerUILink: false,\n      startQtrYYYYQ: null, // use fallback value\n      endQtrYYYYQ: null, // use fallback value\n    });\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeSearchForm />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(\n      await screen.findByTestId(/CourseOverTimeSearch.StartQuarter-option-0/),\n    ).toHaveValue(\"20211\");\n    expect(\n      await screen.findByTestId(/CourseOverTimeSearch.StartQuarter-option-3/),\n    ).toHaveValue(\"20214\");\n  });\n\n  test(\"when I select a course number with the course area too, the course number just retains the number\", async () => {\n    const fetchJSONMock = jest.fn();\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeSearchForm fetchJSON={fetchJSONMock} />\n          <"+"SectionsOverTimeTable sections={mockSections} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    const selectCourseNumber = screen.getByLabelText(\n      \"Course Number (Try searching '16' or '130A')\",\n    );\n\n    userEvent.type(selectCourseNumber, \"CMPSC156\");\n\n    const submitButton = screen.getByText(\"Submit\");\n\n    userEvent.click(submitButton);\n\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(\n          `SectionsOverTimeTable-cell-row-0-col-courseInfo.courseId`,\n        ),\n      ).toHaveTextContent(\"CMPSC\");\n    });\n  });\n\n  test(\"when I select a course number with the course area too (lowercase), the course number just retains the number\", async () => {\n    const fetchJSONMock = jest.fn();\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeSearchForm fetchJSON={fetchJSONMock} />\n          <"+"SectionsOverTimeTable sections={mockSections} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    const selectCourseNumber = screen.getByLabelText(\n      \"Course Number (Try searching '16' or '130A')\",\n    );\n\n    userEvent.type(selectCourseNumber, \"cmpsc 156\");\n\n    const submitButton = screen.getByText(\"Submit\");\n\n    userEvent.click(submitButton);\n\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(\n          `SectionsOverTimeTable-cell-row-0-col-courseInfo.courseId`,\n        ),\n      ).toHaveTextContent(\"CMPSC\");\n    });\n  });\n  test(\"when I select a course number with the course area too (except cs), the course number just retains the number\", async () => {\n    const fetchJSONMock = jest.fn();\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeSearchForm fetchJSON={fetchJSONMock} />\n          <"+"SectionsOverTimeTable sections={mockSections} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    const selectCourseNumber = screen.getByLabelText(\n      \"Course Number (Try searching '16' or '130A')\",\n    );\n\n    userEvent.type(selectCourseNumber, \"cs156\");\n\n    const submitButton = screen.getByText(\"Submit\");\n\n    userEvent.click(submitButton);\n\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(\n          `SectionsOverTimeTable-cell-row-0-col-courseInfo.courseId`,\n        ),\n      ).toHaveTextContent(\"CMPSC\");\n    });\n  });\n  test(\"when I select a course number with the course area too (random casing), the course number just retains the number\", async () => {\n    const fetchJSONMock = jest.fn();\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeSearchForm fetchJSON={fetchJSONMock} />\n          <"+"SectionsOverTimeTable sections={mockSections} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    const selectCourseNumber = screen.getByLabelText(\n      \"Course Number (Try searching '16' or '130A')\",\n    );\n\n    userEvent.type(selectCourseNumber, \"cMpSc156\");\n\n    const submitButton = screen.getByText(\"Submit\");\n\n    userEvent.click(submitButton);\n\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(\n          `SectionsOverTimeTable-cell-row-0-col-courseInfo.courseId`,\n        ),\n      ).toHaveTextContent(\"CMPSC\");\n    });\n  });\n  test(\"when I select a course number with lowercase suffix, it still gives the correct output\", async () => {\n    const fetchJSONMock = jest.fn();\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeSearchForm fetchJSON={fetchJSONMock} />\n          <"+"SectionsOverTimeTable sections={mockSections} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    const selectCourseNumber = screen.getByLabelText(\n      \"Course Number (Try searching '16' or '130A')\",\n    );\n\n    userEvent.type(selectCourseNumber, \"cmPsC         130a\");\n\n    const submitButton = screen.getByText(\"Submit\");\n\n    userEvent.click(submitButton);\n\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(\n          `SectionsOverTimeTable-cell-row-0-col-courseInfo.courseId`,\n        ),\n      ).toHaveTextContent(\"CMPSC\");\n    });\n  });\n  test(\"when I select a course number with the just number, the course number just retains the number\", async () => {\n    const fetchJSONMock = jest.fn();\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeSearchForm fetchJSON={fetchJSONMock} />\n          <"+"SectionsOverTimeTable sections={mockSections} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    const selectCourseNumber = screen.getByLabelText(\n      \"Course Number (Try searching '16' or '130A')\",\n    );\n\n    userEvent.type(selectCourseNumber, \"156\");\n\n    const submitButton = screen.getByText(\"Submit\");\n\n    userEvent.click(submitButton);\n\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(\n          `SectionsOverTimeTable-cell-row-0-col-courseInfo.courseId`,\n        ),\n      ).toHaveTextContent(\"CMPSC\");\n    });\n  });\n});\n"},"src/tests/components/Areas/SingleAreaDropdown.test.js":{"tests":[{"id":"56","name":"SingleAreaDropdown tests renders without crashing on one area","location":{"start":{"column":4,"line":37}}},{"id":"57","name":"SingleAreaDropdown tests renders without crashing on three areas","location":{"start":{"column":4,"line":43}}},{"id":"58","name":"SingleAreaDropdown tests renders \"ALL\" option when showAll is true","location":{"start":{"column":4,"line":71}}},{"id":"59","name":"SingleAreaDropdown tests \"ALL\" option is not available when showAll is false","location":{"start":{"column":4,"line":108}}},{"id":"60","name":"SingleAreaDropdown tests \"ALL\" option is not available by default when showAll is not passed","location":{"start":{"column":4,"line":122}}},{"id":"61","name":"SingleAreaDropdown tests sorts and puts hyphens in testids","location":{"start":{"column":4,"line":136}}},{"id":"62","name":"SingleAreaDropdown tests when I select an object, the value changes","location":{"start":{"column":4,"line":146}}},{"id":"63","name":"SingleAreaDropdown tests when I select \"ALL\" option, value changes to \"ALL\"","location":{"start":{"column":4,"line":164}}},{"id":"64","name":"SingleAreaDropdown tests out of order areas are sorted","location":{"start":{"column":4,"line":183}}},{"id":"65","name":"SingleAreaDropdown tests areas do not contain '- L&S'","location":{"start":{"column":4,"line":208}}},{"id":"66","name":"SingleAreaDropdown tests if I pass a non-null onChange, it gets called when the value changes","location":{"start":{"column":4,"line":226}}},{"id":"67","name":"SingleAreaDropdown tests onChange is called when value is \"ALL\"","location":{"start":{"column":4,"line":251}}},{"id":"68","name":"SingleAreaDropdown tests default label is General Education Area","location":{"start":{"column":4,"line":276}}},{"id":"69","name":"SingleAreaDropdown tests keys / testids are set correctly on options","location":{"start":{"column":4,"line":290}}},{"id":"70","name":"SingleAreaDropdown tests when localstorage has a value, it is passed to useState","location":{"start":{"column":4,"line":305}}},{"id":"71","name":"SingleAreaDropdown tests when localstorage has no value, first element of area list is passed to useState","location":{"start":{"column":4,"line":327}}},{"id":"72","name":"SingleAreaDropdown tests When no areas, dropdown is blank","location":{"start":{"column":4,"line":347}}}],"source":"import { render, screen, waitFor } from \"@testing-library/react\";\nimport userEvent from \"@testing-library/user-event\";\nimport \"@testing-library/jest-dom/extend-expect\";\nimport { useState } from \"react\";\n\nimport SingleAreaDropdown from \"main/components/Areas/SingleAreaDropdown\";\nimport { oneArea } from \"fixtures/areaFixtures\";\nimport { threeAreas } from \"fixtures/areaFixtures\";\nimport { outOfOrderAreas } from \"fixtures/areaFixtures\";\n\njest.mock(\"react\", () => ({\n  ...jest.requireActual(\"react\"),\n  useState: jest.fn(),\n  compareValues: jest.fn(),\n}));\n\ndescribe(\"SingleAreaDropdown tests\", () => {\n  beforeEach(() => {\n    jest.spyOn(console, \"error\");\n    console.error.mockImplementation(() => null);\n  });\n\n  beforeEach(() => {\n    useState.mockImplementation(jest.requireActual(\"react\").useState);\n  });\n\n  afterEach(() => {\n    jest.clearAllMocks();\n  });\n\n  afterEach(() => {\n    console.error.mockRestore();\n  });\n\n  const setArea = jest.fn();\n\n  test(\"renders without crashing on one area\", () => {\n    render(\n      <"+"SingleAreaDropdown areas={oneArea} setArea={setArea} controlId=\"sad1\" />,\n    );\n  });\n\n  test(\"renders without crashing on three areas\", async () => {\n    render(\n      <"+"SingleAreaDropdown\n        areas={[threeAreas[2], threeAreas[0], threeAreas[1]]}\n        setArea={setArea}\n        controlId=\"sad1\"\n      />,\n    );\n\n    const areaA = \"sad1-option-A1-ENGR\";\n    const areaB = \"sad1-option-B-L&S\";\n    const areaC = \"sad1-option-C-L&S\";\n\n    // Check that blanks are replaced with hyphens\n    await waitFor(() => expect(screen.getByTestId(areaA).toBeInTheDocument));\n    await waitFor(() => expect(screen.getByTestId(areaB).toBeInTheDocument));\n    await waitFor(() => expect(screen.getByTestId(areaC).toBeInTheDocument));\n\n    // Check that the options are sorted\n    // See: https://www.atkinsondev.com/post/react-testing-library-order/\n    const allOptions = screen.getAllByTestId(\"sad1-option-\", { exact: false });\n    for (let i = 0; i <"+" allOptions.length - 1; i++) {\n      console.log(\"[i]\" + allOptions[i].value);\n      console.log(\"[i+1]\" + allOptions[i + 1].value);\n      expect(allOptions[i].value <"+" allOptions[i + 1].value).toBe(true);\n    }\n  });\n\n  test('renders \"ALL\" option when showAll is true', async () => {\n    render(\n      <"+"SingleAreaDropdown\n        areas={threeAreas}\n        setArea={setArea}\n        controlId=\"sad1\"\n        showAll={true}\n      />,\n    );\n\n    const allOption = screen.queryByTestId(\"sad1-option-all\");\n    expect(allOption).toBeInTheDocument();\n    expect(allOption).toHaveValue(\"ALL\");\n    expect(allOption).toHaveTextContent(\"ALL\");\n\n    // ensure other options are present\n    const firstAreaAreaOption = await screen.findByTestId(\n      \"sad1-option-A1-ENGR\",\n    );\n    expect(firstAreaAreaOption).toBeInTheDocument();\n    expect(firstAreaAreaOption).toHaveTextContent(\n      \"A1 - English Reading & Composition (ENGR)\",\n    );\n\n    const secondAreaAreaOption = await screen.findByTestId(\"sad1-option-B-L&S\");\n    expect(secondAreaAreaOption).toBeInTheDocument();\n    expect(secondAreaAreaOption).toHaveTextContent(\n      \"B - Foreign Language (L&S)\",\n    );\n\n    const thirdAreaAreaOption = await screen.findByTestId(\"sad1-option-C-L&S\");\n    expect(thirdAreaAreaOption).toBeInTheDocument();\n    expect(thirdAreaAreaOption).toHaveTextContent(\n      \"C - Science, Math and Technology (L&S)\",\n    );\n  });\n\n  test('\"ALL\" option is not available when showAll is false', () => {\n    render(\n      <"+"SingleAreaDropdown\n        areas={threeAreas}\n        setArea={setArea}\n        controlId=\"sad1\"\n        showAll={false} // already false by default, so just visual\n      />,\n    );\n\n    const allOption = screen.queryByTestId(\"sad1-option-all\");\n    expect(allOption).not.toBeInTheDocument();\n  });\n\n  test('\"ALL\" option is not available by default when showAll is not passed', () => {\n    render(\n      <"+"SingleAreaDropdown\n        areas={threeAreas}\n        setArea={setArea}\n        controlId=\"sad15\"\n        // showAll is not passed, should default to false\n      />,\n    );\n\n    const allOption = screen.queryByTestId(\"sad15-option-all\");\n    expect(allOption).not.toBeInTheDocument();\n  });\n\n  test(\"sorts and puts hyphens in testids\", () => {\n    render(\n      <"+"SingleAreaDropdown\n        areas={threeAreas}\n        setArea={setArea}\n        controlId=\"sad1\"\n      />,\n    );\n  });\n\n  test(\"when I select an object, the value changes\", async () => {\n    render(\n      <"+"SingleAreaDropdown\n        areas={threeAreas}\n        setArea={setArea}\n        controlId=\"sad1\"\n      />,\n    );\n\n    expect(\n      await screen.findByLabelText(\"General Education Area\"),\n    ).toBeInTheDocument();\n\n    const selectArea = screen.getByLabelText(\"General Education Area\");\n    userEvent.selectOptions(selectArea, \"C-L&S\");\n    expect(setArea).toBeCalledWith(\"C-L&S\");\n  });\n\n  test('when I select \"ALL\" option, value changes to \"ALL\"', async () => {\n    render(\n      <"+"SingleAreaDropdown\n        areas={threeAreas}\n        setArea={setArea}\n        controlId=\"sad1\"\n        showAll={true}\n      />,\n    );\n\n    expect(\n      await screen.findByLabelText(\"General Education Area\"),\n    ).toBeInTheDocument();\n\n    const selectQuarter = screen.getByLabelText(\"General Education Area\");\n    userEvent.selectOptions(selectQuarter, \"ALL\");\n    expect(setArea).toBeCalledWith(\"ALL\");\n  });\n\n  test(\"out of order areas are sorted\", async () => {\n    render(\n      <"+"SingleAreaDropdown\n        areas={outOfOrderAreas}\n        setArea={setArea}\n        controlId=\"sad1\"\n      />,\n    );\n\n    expect(\n      await screen.findByLabelText(\"General Education Area\"),\n    ).toBeInTheDocument();\n\n    const options = screen.getAllByRole(\"option\");\n    const optionTexts = options.map((option) => option.textContent);\n    const expectedOrder = [\n      \"A1 - English Reading & Composition (ENGR)\",\n      \"A1 - English Reading & Composition (L&S)\",\n      \"A2 - English Reading & Composition (L&S)\",\n      \"C - Science, Math and Technology (L&S)\",\n    ];\n\n    expect(optionTexts).toEqual(expectedOrder);\n  });\n\n  test(\"areas do not contain '- L&S'\", async () => {\n    render(\n      <"+"SingleAreaDropdown\n        areas={threeAreas}\n        setArea={setArea}\n        controlId=\"sad1\"\n      />,\n    );\n\n    expect(\n      await screen.findByLabelText(\"General Education Area\"),\n    ).toBeInTheDocument();\n    const options = screen.getAllByRole(\"option\");\n    options.forEach((option) => {\n      expect(option.textContent).not.toContain(\"- L&S\");\n    });\n  });\n\n  test(\"if I pass a non-null onChange, it gets called when the value changes\", async () => {\n    const onChange = jest.fn();\n    render(\n      <"+"SingleAreaDropdown\n        areas={threeAreas}\n        setArea={setArea}\n        controlId=\"sad1\"\n        onChange={onChange}\n      />,\n    );\n\n    expect(\n      await screen.findByLabelText(\"General Education Area\"),\n    ).toBeInTheDocument();\n\n    const selectArea = screen.getByLabelText(\"General Education Area\");\n    userEvent.selectOptions(selectArea, \"B-L&S\");\n    await waitFor(() => expect(setArea).toBeCalledWith(\"B-L&S\"));\n    await waitFor(() => expect(onChange).toBeCalledTimes(1));\n\n    // x.mock.calls[0][0] is the first argument of the first call to the jest.fn() mock x\n    const event = onChange.mock.calls[0][0];\n    expect(event.target.value).toBe(\"B-L&S\");\n  });\n\n  test('onChange is called when value is \"ALL\"', async () => {\n    const onChange = jest.fn();\n    render(\n      <"+"SingleAreaDropdown\n        areas={threeAreas}\n        setArea={setArea}\n        controlId=\"sad1\"\n        showAll={true}\n        onChange={onChange}\n      />,\n    );\n\n    expect(\n      await screen.findByLabelText(\"General Education Area\"),\n    ).toBeInTheDocument();\n\n    const selectArea = screen.getByLabelText(\"General Education Area\");\n    userEvent.selectOptions(selectArea, \"ALL\");\n    await waitFor(() => expect(setArea).toBeCalledWith(\"ALL\"));\n    await waitFor(() => expect(onChange).toBeCalledTimes(1));\n\n    const event = onChange.mock.calls[0][0];\n    expect(event.target.value).toBe(\"ALL\");\n  });\n\n  test(\"default label is General Education Area\", async () => {\n    render(\n      <"+"SingleAreaDropdown\n        areas={threeAreas}\n        setArea={setArea}\n        controlId=\"sad1\"\n      />,\n    );\n\n    expect(\n      await screen.findByLabelText(\"General Education Area\"),\n    ).toBeInTheDocument();\n  });\n\n  test(\"keys / testids are set correctly on options\", async () => {\n    render(\n      <"+"SingleAreaDropdown\n        areas={threeAreas}\n        setArea={setArea}\n        controlId=\"sad1\"\n      />,\n    );\n\n    const expectedKey = \"sad1-option-A1-ENGR\";\n    await waitFor(() =>\n      expect(screen.getByTestId(expectedKey).toBeInTheDocument),\n    );\n  });\n\n  test(\"when localstorage has a value, it is passed to useState\", async () => {\n    const getItemSpy = jest.spyOn(Storage.prototype, \"getItem\");\n    getItemSpy.mockImplementation(\n      () => \"C - Science, Math and Technology (L&S)\",\n    );\n\n    const setAreaStateSpy = jest.fn();\n    useState.mockImplementation((x) => [x, setAreaStateSpy]);\n\n    render(\n      <"+"SingleAreaDropdown\n        areas={threeAreas}\n        setArea={setArea}\n        controlId=\"sad1\"\n      />,\n    );\n\n    await waitFor(() =>\n      expect(useState).toBeCalledWith(\"C - Science, Math and Technology (L&S)\"),\n    );\n  });\n\n  test(\"when localstorage has no value, first element of area list is passed to useState\", async () => {\n    const getItemSpy = jest.spyOn(Storage.prototype, \"getItem\");\n    getItemSpy.mockImplementation(() => null);\n\n    const setAreaStateSpy = jest.fn();\n    useState.mockImplementation((x) => [x, setAreaStateSpy]);\n\n    render(\n      <"+"SingleAreaDropdown\n        areas={threeAreas}\n        setArea={setArea}\n        controlId=\"sad1\"\n      />,\n    );\n\n    await waitFor(() =>\n      expect(useState).toBeCalledWith(expect.objectContaining({})),\n    );\n  });\n\n  test(\"When no areas, dropdown is blank\", async () => {\n    render(\n      <"+"SingleAreaDropdown areas={[]} setArea={setArea} controlId=\"sad1\" />,\n    );\n\n    const expectedKey = \"sad1\";\n    expect(screen.queryByTestId(expectedKey)).toBeNull();\n  });\n});\n"},"src/tests/pages/GeneralEducation/GeneralEducationSearchPage.test.js":{"tests":[{"id":"77","name":"GeneralEducationSearchForm tests renders without crashing","location":{"start":{"column":4,"line":49}}},{"id":"79","name":"GeneralEducationSearchForm tests selecting an area updates the state","location":{"start":{"column":4,"line":77}}},{"id":"80","name":"GeneralEducationSearchForm tests selecting a quarter updates the state","location":{"start":{"column":4,"line":100}}},{"id":"81","name":"GeneralEducationSearchForm tests submitting the form calls fetchJSON with correct area and quarter","location":{"start":{"column":4,"line":116}}},{"id":"116","name":"GeneralEducationSearchForm tests area and quarter dropdowns are rendered","location":{"start":{"column":4,"line":59}}},{"id":"117","name":"GeneralEducationSearchForm tests when JSON is empty, setCourse is not called","location":{"start":{"column":4,"line":151}}}],"source":"import React from \"react\";\nimport { render, screen, waitFor } from \"@testing-library/react\";\nimport userEvent from \"@testing-library/user-event\";\nimport { toast } from \"react-toastify\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\n\nimport { allTheAreas } from \"fixtures/areaFixtures\";\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\n\nimport GeneralEducationSearchForm from \"main/components/GeneralEducation/GeneralEducationSearchForm\";\n\n// Mock toast\njest.mock(\"react-toastify\", () => ({\n  toast: jest.fn(),\n}));\n\n// Mock useSystemInfo to return a valid quarter range\njest.mock(\"main/utils/systemInfo\", () => ({\n  useSystemInfo: () => ({\n    data: {\n      startQtrYYYYQ: \"20221\",\n      endQtrYYYYQ: \"20222\",\n    },\n  }),\n}));\n\ndescribe(\"GeneralEducationSearchForm tests\", () => {\n  const axiosMock = new AxiosMockAdapter(axios);\n  const queryClient = new QueryClient();\n  const addToast = jest.fn();\n\n  beforeEach(() => {\n    jest.clearAllMocks();\n    jest.spyOn(console, \"error\");\n    console.error.mockImplementation(() => null);\n\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.userOnly);\n\n    toast.mockReturnValue({\n      addToast: addToast,\n    });\n  });\n\n  test(\"renders without crashing\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"GeneralEducationSearchForm />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n  });\n\n  test(\"area and quarter dropdowns are rendered\", async () => {\n    axiosMock.onGet(\"/api/public/generalEducationInfo\").reply(200, allTheAreas);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"GeneralEducationSearchForm />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const quarterDropdown = await screen.findByLabelText(\"Quarter\");\n    expect(quarterDropdown).toBeInTheDocument();\n\n    const areaDropdown = await screen.findByLabelText(\"General Education Area\");\n    expect(areaDropdown).toBeInTheDocument();\n  });\n\n  test(\"selecting an area updates the state\", async () => {\n    axiosMock.onGet(\"/api/public/generalEducationInfo\").reply(200, allTheAreas);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"GeneralEducationSearchForm />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(\"GeneralEducationSearch.Area-option-C-ENGR\"),\n      ).toBeInTheDocument();\n    });\n\n    const selectArea = screen.getByLabelText(\"General Education Area\");\n    userEvent.selectOptions(selectArea, \"C-ENGR\");\n\n    expect(selectArea.value).toBe(\"C-ENGR\");\n  });\n\n  test(\"selecting a quarter updates the state\", async () => {\n    axiosMock.onGet(\"/api/public/generalEducationInfo\").reply(200, allTheAreas);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"GeneralEducationSearchForm />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const selectQuarter = await screen.findByLabelText(\"Quarter\");\n    userEvent.selectOptions(selectQuarter, \"20222\");\n    expect(selectQuarter.value).toBe(\"20222\");\n  });\n\n  test(\"submitting the form calls fetchJSON with correct area and quarter\", async () => {\n    axiosMock.onGet(\"/api/public/generalEducationInfo\").reply(200, allTheAreas);\n    const fetchJSONSpy = jest.fn().mockResolvedValue({});\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"GeneralEducationSearchForm fetchJSON={fetchJSONSpy} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(\"GeneralEducationSearch.Area-option-WRT-L&S\"),\n      ).toBeInTheDocument();\n    });\n\n    const selectArea = screen.getByLabelText(\"General Education Area\");\n    userEvent.selectOptions(selectArea, \"WRT-L&S\");\n\n    const selectQuarter = await screen.findByLabelText(\"Quarter\");\n    userEvent.selectOptions(selectQuarter, \"20222\");\n\n    const submitButton = screen.getByText(\"Submit\");\n    userEvent.click(submitButton);\n\n    await waitFor(() => expect(fetchJSONSpy).toHaveBeenCalledTimes(1));\n\n    expect(fetchJSONSpy).toHaveBeenCalledWith(expect.any(Object), {\n      area: \"WRT-L&S\",\n      quarter: \"20222\",\n    });\n  });\n\n  test(\"when JSON is empty, setCourse is not called\", async () => {\n    axiosMock.onGet(\"/api/public/generalEducationInfo\").reply(200, allTheAreas);\n    const fetchJSONSpy = jest.fn().mockResolvedValue({\n      sampleKey: \"sampleValue\",\n      total: 0,\n    });\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"GeneralEducationSearchForm fetchJSON={fetchJSONSpy} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(\"GeneralEducationSearch.Area-option-D-L&S\"),\n      ).toBeInTheDocument();\n    });\n\n    const selectArea = screen.getByLabelText(\"General Education Area\");\n    userEvent.selectOptions(selectArea, \"D-L&S\");\n\n    const selectQuarter = await screen.findByLabelText(\"Quarter\");\n    userEvent.selectOptions(selectQuarter, \"20221\");\n\n    const submitButton = screen.getByText(\"Submit\");\n    userEvent.click(submitButton);\n\n    await waitFor(() => expect(fetchJSONSpy).toHaveBeenCalledTimes(1));\n  });\n});\n"},"src/tests/components/GeneralEducation/GeneralEducationSearchForm.test.js":{"tests":[{"id":"78","name":"GeneralEducationSearchForm tests area and quar
