ter dropdowns are rendered and populated","location":{"start":{"column":4,"line":69}}},{"id":"82","name":"GeneralEducationSearchForm tests form submission with different values","location":{"start":{"column":4,"line":175}}}],"source":"import React from \"react\";\nimport { render, screen, waitFor } from \"@testing-library/react\";\nimport userEvent from \"@testing-library/user-event\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\n\nimport { allTheAreas } from \"fixtures/areaFixtures\";\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\n\nimport GeneralEducationSearchForm from \"main/components/GeneralEducation/GeneralEducationSearchForm\";\n\njest.mock(\"react-toastify\", () => ({\n  toast: jest.fn(),\n}));\n\njest.mock(\"main/utils/systemInfo\", () => ({\n  useSystemInfo: () => ({\n    data: {\n      startQtrYYYYQ: \"20221\",\n      endQtrYYYYQ: \"20222\",\n    },\n  }),\n}));\n\nconst getAreaOptionDisplayRegExp = (areaData) => {\n  if (!areaData) return /.*/;\n  const escapeRegExp = (string) =>\n    string.replace(/[.*+?^${}()|[\\]\\\\]/g, \"\\\\$&\");\n\n  const reqCode = escapeRegExp(areaData.requirementCode);\n  const reqTrans = escapeRegExp(areaData.requirementTranslation);\n  const colCode = escapeRegExp(areaData.collegeCode);\n\n  return new RegExp(`^${reqCode}\\\\s*-\\\\s*${reqTrans}\\\\s*\\\\(${colCode}\\\\)$`); // Added ^ and $ for exact match\n};\n\ndescribe(\"GeneralEducationSearchForm tests\", () => {\n  const axiosMock = new AxiosMockAdapter(axios);\n  const queryClient = new QueryClient();\n\n  beforeEach(() => {\n    jest.clearAllMocks();\n\n    axiosMock.resetHistory();\n    axiosMock.resetHandlers();\n\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.userOnly);\n\n    axiosMock.onGet(\"/api/public/generalEducationInfo\").reply(200, allTheAreas);\n  });\n\n  test(\"renders without crashing\", async () => {\n    // Make async to allow for potential initial async effects\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"GeneralEducationSearchForm fetchJSON={jest.fn()} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    // Add a small wait to see if it helps with initial act warnings\n    await screen.findByText(\"Submit\"); // Ensure form is rendered\n  });\n\n  test(\"area and quarter dropdowns are rendered and populated\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"GeneralEducationSearchForm fetchJSON={jest.fn()} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const quarterDropdown = await screen.findByLabelText(\"Quarter\");\n    expect(quarterDropdown).toBeInTheDocument();\n    // Check for a quarter option - text derived from SingleQuarterDropdown implementation (e.g., \"W22\")\n    expect(\n      await screen.findByRole(\"option\", { name: \"W22\" }),\n    ).toBeInTheDocument();\n\n    const areaDropdown = await screen.findByLabelText(\"General Education Area\");\n    expect(areaDropdown).toBeInTheDocument();\n\n    const firstAreaEntry = allTheAreas.find(\n      (a) => a.requirementCode === \"A1\" && a.collegeCode === \"ENGR\",\n    );\n    expect(\n      await screen.findByRole(\"option\", {\n        name: getAreaOptionDisplayRegExp(firstAreaEntry),\n      }),\n    ).toBeInTheDocument();\n  });\n\n  test(\"selecting an area updates the state\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"GeneralEducationSearchForm fetchJSON={jest.fn()} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const selectArea = await screen.findByLabelText(\"General Education Area\");\n    const targetAreaData = allTheAreas.find(\n      (a) => a.requirementCode === \"C\" && a.collegeCode === \"ENGR\",\n    );\n\n    // Wait for the option to appear using the RegExp\n    await screen.findByRole(\"option\", {\n      name: getAreaOptionDisplayRegExp(targetAreaData),\n    });\n\n    await userEvent.selectOptions(selectArea, \"C-ENGR\"); // \"C-ENGR\" is the value attribute\n\n    expect(selectArea.value).toBe(\"C-ENGR\");\n  });\n\n  test(\"selecting a quarter updates the state\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"GeneralEducationSearchForm fetchJSON={jest.fn()} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const selectQuarter = await screen.findByLabelText(\"Quarter\");\n    await screen.findByRole(\"option\", { name: \"S22\" }); // Assuming 20222 maps to S22\n\n    await userEvent.selectOptions(selectQuarter, \"20222\");\n    expect(selectQuarter.value).toBe(\"20222\");\n  });\n\n  test(\"submitting the form calls fetchJSON with correct area and quarter\", async () => {\n    const fetchJSONSpy = jest.fn();\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"GeneralEducationSearchForm fetchJSON={fetchJSONSpy} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const selectArea = await screen.findByLabelText(\"General Education Area\");\n    const targetAreaDataWRT = allTheAreas.find(\n      (a) => a.requirementCode === \"WRT\" && a.collegeCode === \"ENGR\",\n    );\n    await screen.findByRole(\"option\", {\n      name: getAreaOptionDisplayRegExp(targetAreaDataWRT),\n    });\n    await userEvent.selectOptions(selectArea, \"WRT-ENGR\");\n\n    const selectQuarter = await screen.findByLabelText(\"Quarter\");\n    await screen.findByRole(\"option\", { name: \"S22\" });\n    await userEvent.selectOptions(selectQuarter, \"20222\");\n\n    const submitButton = screen.getByText(\"Submit\");\n    await userEvent.click(submitButton); // userEvent.click is async\n\n    await waitFor(() => {\n      expect(fetchJSONSpy).toHaveBeenCalledTimes(1);\n    });\n\n    expect(fetchJSONSpy).toHaveBeenCalledWith(expect.any(Object), {\n      area: \"WRT-ENGR\",\n      quarter: \"20222\",\n    });\n  });\n\n  test(\"form submission with different values\", async () => {\n    const fetchJSONSpy = jest.fn();\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"GeneralEducationSearchForm fetchJSON={fetchJSONSpy} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const selectArea = await screen.findByLabelText(\"General Education Area\");\n    const targetAreaDataDLS = allTheAreas.find(\n      (a) => a.requirementCode === \"D\" && a.collegeCode === \"L&S\",\n    );\n    await screen.findByRole(\"option\", {\n      name: getAreaOptionDisplayRegExp(targetAreaDataDLS),\n    });\n    await userEvent.selectOptions(selectArea, \"D-L&S\");\n\n    const selectQuarter = await screen.findByLabelText(\"Quarter\");\n    await screen.findByRole(\"option\", { name: \"W22\" });\n    await userEvent.selectOptions(selectQuarter, \"20221\");\n\n    const submitButton = screen.getByText(\"Submit\");\n    await userEvent.click(submitButton);\n\n    await waitFor(() => {\n      expect(fetchJSONSpy).toHaveBeenCalledTimes(1);\n    });\n\n    expect(fetchJSONSpy).toHaveBeenCalledWith(expect.any(Object), {\n      area: \"D-L&S\",\n      quarter: \"20221\",\n    });\n  });\n});\n"},"src/tests/components/Classrooms/SingleClassroomDropdown.test.js":{"tests":[{"id":"83","name":"SingleClassroomDropdown renders a single classroom option","location":{"start":{"column":4,"line":23}}},{"id":"84","name":"SingleClassroomDropdown sorts and filters three classrooms by building","location":{"start":{"column":4,"line":38}}},{"id":"85","name":"SingleClassroomDropdown shows ALL option when showAll is true","location":{"start":{"column":4,"line":56}}},{"id":"86","name":"SingleClassroomDropdown filters classrooms by building when showAll is false","location":{"start":{"column":4,"line":75}}},{"id":"87","name":"SingleClassroomDropdown calls setClassroom and onChange on select","location":{"start":{"column":4,"line":93}}},{"id":"88","name":"SingleClassroomDropdown initializes value from localStorage if present","location":{"start":{"column":4,"line":111}}},{"id":"89","name":"SingleClassroomDropdown renders nothing when no classrooms and showAll is false","location":{"start":{"column":4,"line":126}}},{"id":"90","name":"SingleClassroomDropdown initializes from classroom prop when no localStorage","location":{"start":{"column":4,"line":139}}},{"id":"91","name":"SingleClassroomDropdown resets value and parent when building changes","location":{"start":{"column":4,"line":154}}},{"id":"92","name":"SingleClassroomDropdown defaults to first classroom when neither localStorage nor classroom prop is set","location":{"start":{"column":4,"line":181}}},{"id":"93","name":"SingleClassroomDropdown sorts even an unsorted classroom list by roomNumber","location":{"start":{"column":4,"line":196}}},{"id":"94","name":"SingleClassroomDropdown replaces spaces with hyphens in the generated test-id slug","location":{"start":{"column":4,"line":215}}}],"source":"import React from \"react\";\nimport { render, screen } from \"@testing-library/react\";\nimport userEvent from \"@testing-library/user-event\";\nimport \"@testing-library/jest-dom/extend-expect\";\n\nimport SingleClassroomDropdown from \"main/components/Classrooms/SingleClassroomDropdown\";\nimport {\n  oneClassroom,\n  threeClassrooms,\n  allClassrooms,\n} from \"fixtures/classroomFixtures\";\n\n// Note: No mocks for compareValues or React; using real implementations\n\ndescribe(\"SingleClassroomDropdown\", () => {\n  let setClassroom;\n\n  beforeEach(() => {\n    setClassroom = jest.fn();\n    window.localStorage.clear();\n  });\n\n  test(\"renders a single classroom option\", () => {\n    render(\n      <"+"SingleClassroomDropdown\n        building=\"ILP\"\n        classrooms={oneClassroom}\n        classroom=\"\"\n        setClassroom={setClassroom}\n        controlId=\"cd1\"\n      />,\n    );\n    const option = screen.getByTestId(\"cd1-option-ILP-1101\");\n    expect(option).toBeInTheDocument();\n    expect(option).toHaveTextContent(\"ILP 1101\");\n  });\n\n  test(\"sorts and filters three classrooms by building\", () => {\n    render(\n      <"+"SingleClassroomDropdown\n        building=\"ILP\"\n        classrooms={threeClassrooms}\n        classroom=\"\"\n        setClassroom={setClassroom}\n        controlId=\"cd1\"\n      />,\n    );\n    // Should see 3 ILP rooms: 1101, 3211, 3316\n    const opts = screen.getAllByRole(\"option\").filter((o) => o.value !== \"ALL\");\n    expect(opts).toHaveLength(3);\n    expect(opts[0]).toHaveTextContent(\"ILP 1101\");\n    expect(opts[1]).toHaveTextContent(\"ILP 3211\");\n    expect(opts[2]).toHaveTextContent(\"ILP 3316\");\n  });\n\n  test(\"shows ALL option when showAll is true\", () => {\n    render(\n      <"+"SingleClassroomDropdown\n        building=\"ILP\"\n        classrooms={allClassrooms}\n        classroom=\"\"\n        setClassroom={setClassroom}\n        controlId=\"cd1\"\n        showAll\n      />,\n    );\n    const allOpt = screen.getByTestId(\"cd1-option-all\");\n    expect(allOpt).toBeInTheDocument();\n    expect(allOpt).toHaveValue(\"ALL\");\n    expect(allOpt).toHaveTextContent(\"ALL\");\n    // Ensure at least one classroom appears\n    expect(screen.getByTestId(\"cd1-option-ILP-1101\")).toBeInTheDocument();\n  });\n\n  test(\"filters classrooms by building when showAll is false\", () => {\n    render(\n      <"+"SingleClassroomDropdown\n        building=\"ILP\"\n        classrooms={allClassrooms}\n        classroom=\"\"\n        setClassroom={setClassroom}\n        controlId=\"cd1\"\n      />,\n    );\n\n    const opts = screen.getAllByRole(\"option\").filter((o) => o.value !== \"ALL\");\n\n    opts.forEach((o) => {\n      expect(o).toHaveTextContent(\"ILP\");\n    });\n  });\n\n  test(\"calls setClassroom and onChange on select\", () => {\n    const onChange = jest.fn();\n    render(\n      <"+"SingleClassroomDropdown\n        building=\"ILP\"\n        classrooms={threeClassrooms}\n        classroom=\"\"\n        setClassroom={setClassroom}\n        controlId=\"cd1\"\n        onChange={onChange}\n      />,\n    );\n    const select = screen.getByLabelText(\"Classroom\");\n    userEvent.selectOptions(select, \"3211\");\n    expect(setClassroom).toHaveBeenCalledWith(\"3211\");\n    expect(onChange).toHaveBeenCalledTimes(1);\n  });\n\n  test(\"initializes value from localStorage if present\", () => {\n    window.localStorage.setItem(\"cd1\", \"1101\");\n    render(\n      <"+"SingleClassroomDropdown\n        building=\"ILP\"\n        classrooms={threeClassrooms}\n        classroom=\"\"\n        setClassroom={setClassroom}\n        controlId=\"cd1\"\n      />,\n    );\n    const combobox = screen.getByRole(\"combobox\");\n    expect(combobox.value).toBe(\"1101\");\n  });\n\n  test(\"renders nothing when no classrooms and showAll is false\", () => {\n    render(\n      <"+"SingleClassroomDropdown\n        building=\"ILP\"\n        classrooms={[]}\n        classroom=\"\"\n        setClassroom={setClassroom}\n        controlId=\"cd1\"\n      />,\n    );\n    expect(screen.queryByRole(\"option\")).toBeNull();\n  });\n\n  test(\"initializes from classroom prop when no localStorage\", () => {\n    window.localStorage.clear();\n    render(\n      <"+"SingleClassroomDropdown\n        building=\"ILP\"\n        classrooms={threeClassrooms}\n        classroom=\"3211\"\n        setClassroom={setClassroom}\n        controlId=\"cd1\"\n      />,\n    );\n    const combobox = screen.getByRole(\"combobox\");\n    expect(combobox.value).toBe(\"3211\");\n  });\n\n  test(\"resets value and parent when building changes\", () => {\n    const { rerender } = render(\n      <"+"SingleClassroomDropdown\n        building=\"ILP\"\n        classrooms={threeClassrooms}\n        classroom=\"\"\n        setClassroom={setClassroom}\n        controlId=\"cd1\"\n      />,\n    );\n    const select = screen.getByRole(\"combobox\");\n    userEvent.selectOptions(select, \"3211\");\n    expect(setClassroom).toHaveBeenCalledWith(\"3211\");\n\n    rerender(\n      <"+"SingleClassroomDropdown\n        building=\"ENG\"\n        classrooms={allClassrooms}\n        classroom=\"3211\"\n        setClassroom={setClassroom}\n        controlId=\"cd1\"\n      />,\n    );\n    expect(select.value).toBe(\"\");\n    expect(setClassroom).toHaveBeenCalledWith(\"\");\n  });\n\n  test(\"defaults to first classroom when neither localStorage nor classroom prop is set\", () => {\n    render(\n      <"+"SingleClassroomDropdown\n        building=\"ILP\"\n        classrooms={threeClassrooms}\n        classroom=\"\"\n        setClassroom={setClassroom}\n        controlId=\"cdDefault\"\n      />,\n    );\n    const combobox = screen.getByRole(\"combobox\");\n    // first sorted ILP roomNumber is \"1101\"\n    expect(combobox.value).toBe(\"1101\");\n  });\n\n  test(\"sorts even an unsorted classroom list by roomNumber\", () => {\n    const unsorted = [\n      { buildingCode: \"ILP\", roomNumber: \"3316\" },\n      { buildingCode: \"ILP\", roomNumber: \"1101\" },\n      { buildingCode: \"ILP\", roomNumber: \"3211\" },\n    ];\n    render(\n      <"+"SingleClassroomDropdown\n        building=\"ILP\"\n        classrooms={unsorted}\n        classroom=\"\"\n        setClassroom={setClassroom}\n        controlId=\"cdSort\"\n      />,\n    );\n    const opts = screen.getAllByRole(\"option\").filter((o) => o.value !== \"ALL\");\n    expect(opts.map((o) => o.value)).toEqual([\"1101\", \"3211\", \"3316\"]);\n  });\n\n  test(\"replaces spaces with hyphens in the generated test-id slug\", () => {\n    const withSpaces = [{ buildingCode: \"ENG LAB\", roomNumber: \"101 A\" }];\n    render(\n      <"+"SingleClassroomDropdown\n        building=\"ENG LAB\"\n        classrooms={withSpaces}\n        classroom=\"\"\n        setClassroom={setClassroom}\n        controlId=\"cdSlug\"\n      />,\n    );\n    expect(\n      screen.getByTestId(\"cdSlug-option-ENG-LAB-101-A\"),\n    ).toBeInTheDocument();\n  });\n});\n"},"src/tests/components/Utils/OurPagination.test.js":{"tests":[{"id":"95","name":"OurPagination tests emptyArray returns empty array","location":{"start":{"column":4,"line":22}}},{"id":"96","name":"OurPagination tests renders the correct text for totalPages 5 maxPages 10","location":{"start":{"column":4,"line":26}}},{"id":"97","name":"OurPagination tests renders the correct text for totalPages 10 maxPages 10","location":{"start":{"column":4,"line":47}}},{"id":"98","name":"OurPagination tests renders the correct text for totalPages 12 maxPages 5","location":{"start":{"column":4,"line":72}}},{"id":"99","name":"OurPagination tests renders the correct text for totalPages 5 maxPages 2","location":{"start":{"column":4,"line":185}}},{"id":"100","name":"OurPagination tests updates active page when currentPage prop changes","location":{"start":{"column":4,"line":235}}}],"source":"import { fireEvent, render, screen } from \"@testing-library/react\";\nimport OurPagination, { emptyArray } from \"main/components/Utils/OurPagination\";\nimport React from \"react\";\n\nfunction ControlledPaginationWrapper(props) {\n  const [page, setPage] = React.useState(1);\n  return (\n    <"+"OurPagination {...props} currentPage={page} updateActivePage={setPage} />\n  );\n}\n\nconst checkTestIdsInOrder = (testIds) => {\n  const links = screen.getAllByTestId(/OurPagination-/);\n  expect(links.length).toBe(testIds.length);\n\n  for (var i = 0; i <"+" links.length; i++) {\n    expect(screen.getByTestId(testIds[i])).toBe(links[i]);\n  }\n};\n\ndescribe(\"OurPagination tests\", () => {\n  test(\"emptyArray returns empty array\", () => {\n    expect(emptyArray()).toStrictEqual([]);\n  });\n\n  test(\"renders the correct text for totalPages 5 maxPages 10\", async () => {\n    // Arrange\n\n    jest.fn();\n\n    // Act\n    render(<"+"ControlledPaginationWrapper totalPages={5} maxPages={10} />);\n\n    // Assert\n\n    checkTestIdsInOrder([\n      \"OurPagination-prev\",\n      \"OurPagination-1\",\n      \"OurPagination-2\",\n      \"OurPagination-3\",\n      \"OurPagination-4\",\n      \"OurPagination-5\",\n      \"OurPagination-next\",\n    ]);\n  });\n\n  test(\"renders the correct text for totalPages 10 maxPages 10\", async () => {\n    // Arrange\n\n    jest.fn();\n\n    // Act\n    render(<"+"ControlledPaginationWrapper totalPages={10} maxPages={10} />);\n\n    // Assert\n    checkTestIdsInOrder([\n      \"OurPagination-prev\",\n      \"OurPagination-1\",\n      \"OurPagination-2\",\n      \"OurPagination-3\",\n      \"OurPagination-4\",\n      \"OurPagination-5\",\n      \"OurPagination-6\",\n      \"OurPagination-7\",\n      \"OurPagination-8\",\n      \"OurPagination-9\",\n      \"OurPagination-10\",\n      \"OurPagination-next\",\n    ]);\n  });\n\n  test(\"renders the correct text for totalPages 12 maxPages 5\", async () => {\n    // Arrange\n\n    jest.fn();\n\n    // Act\n    render(<"+"ControlledPaginationWrapper totalPages={12} maxPages={5} />);\n\n    // Assert\n    checkTestIdsInOrder([\n      \"OurPagination-prev\",\n      \"OurPagination-1\",\n      \"OurPagination-2\",\n      \"OurPagination-right-ellipsis\",\n      \"OurPagination-12\",\n      \"OurPagination-next\",\n    ]);\n\n    const nextButton = screen.getByTestId(\"OurPagination-next\");\n    fireEvent.click(nextButton);\n\n    checkTestIdsInOrder([\n      \"OurPagination-prev\",\n      \"OurPagination-1\",\n      \"OurPagination-2\",\n      \"OurPagination-3\",\n      \"OurPagination-right-ellipsis\",\n      \"OurPagination-12\",\n      \"OurPagination-next\",\n    ]);\n\n    fireEvent.click(nextButton);\n\n    checkTestIdsInOrder([\n      \"OurPagination-prev\",\n      \"OurPagination-1\",\n      \"OurPagination-2\",\n      \"OurPagination-3\",\n      \"OurPagination-4\",\n      \"OurPagination-right-ellipsis\",\n      \"OurPagination-12\",\n      \"OurPagination-next\",\n    ]);\n\n    fireEvent.click(nextButton);\n\n    checkTestIdsInOrder([\n      \"OurPagination-prev\",\n      \"OurPagination-1\",\n      \"OurPagination-left-ellipsis\",\n      \"OurPagination-3\",\n      \"OurPagination-4\",\n      \"OurPagination-5\",\n      \"OurPagination-right-ellipsis\",\n      \"OurPagination-12\",\n      \"OurPagination-next\",\n    ]);\n\n    const prevButton = screen.getByTestId(\"OurPagination-prev\");\n    fireEvent.click(prevButton);\n\n    checkTestIdsInOrder([\n      \"OurPagination-prev\",\n      \"OurPagination-1\",\n      \"OurPagination-2\",\n      \"OurPagination-3\",\n      \"OurPagination-4\",\n      \"OurPagination-right-ellipsis\",\n      \"OurPagination-12\",\n      \"OurPagination-next\",\n    ]);\n\n    const button1 = screen.getByTestId(\"OurPagination-1\");\n    fireEvent.click(button1);\n\n    checkTestIdsInOrder([\n      \"OurPagination-prev\",\n      \"OurPagination-1\",\n      \"OurPagination-2\",\n      \"OurPagination-right-ellipsis\",\n      \"OurPagination-12\",\n      \"OurPagination-next\",\n    ]);\n\n    const button12 = screen.getByTestId(\"OurPagination-12\");\n    fireEvent.click(button12);\n\n    checkTestIdsInOrder([\n      \"OurPagination-prev\",\n      \"OurPagination-1\",\n      \"OurPagination-left-ellipsis\",\n      \"OurPagination-11\",\n      \"OurPagination-12\",\n      \"OurPagination-next\",\n    ]);\n\n    fireEvent.click(prevButton);\n    fireEvent.click(prevButton);\n    fireEvent.click(prevButton);\n\n    checkTestIdsInOrder([\n      \"OurPagination-prev\",\n      \"OurPagination-1\",\n      \"OurPagination-left-ellipsis\",\n      \"OurPagination-8\",\n      \"OurPagination-9\",\n      \"OurPagination-10\",\n      \"OurPagination-right-ellipsis\",\n      \"OurPagination-12\",\n      \"OurPagination-next\",\n    ]);\n  });\n\n  test(\"renders the correct text for totalPages 5 maxPages 2\", async () => {\n    // Arrange\n\n    jest.fn();\n\n    // Act\n    render(<"+"ControlledPaginationWrapper totalPages={5} maxPages={2} />);\n\n    // Assert\n\n    checkTestIdsInOrder([\n      \"OurPagination-prev\",\n      \"OurPagination-1\",\n      \"OurPagination-2\",\n      \"OurPagination-right-ellipsis\",\n      \"OurPagination-5\",\n      \"OurPagination-next\",\n    ]);\n\n    const button1 = screen.getByTestId(\"OurPagination-1\");\n    expect(button1.parentElement).toHaveClass(\"active\");\n    const button2 = screen.getByTestId(\"OurPagination-2\");\n    expect(button2.parentElement).not.toHaveClass(\"active\");\n\n    const nextButton = screen.getByTestId(\"OurPagination-next\");\n    fireEvent.click(nextButton);\n    checkTestIdsInOrder([\n      \"OurPagination-prev\",\n      \"OurPagination-1\",\n      \"OurPagination-2\",\n      \"OurPagination-3\",\n      \"OurPagination-right-ellipsis\",\n      \"OurPagination-5\",\n      \"OurPagination-next\",\n    ]);\n\n    fireEvent.click(nextButton);\n    checkTestIdsInOrder([\n      \"OurPagination-prev\",\n      \"OurPagination-1\",\n      \"OurPagination-2\",\n      \"OurPagination-3\",\n      \"OurPagination-4\",\n      \"OurPagination-5\",\n      \"OurPagination-next\",\n    ]);\n\n    fireEvent.click(nextButton);\n  });\n\n  test(\"updates active page when currentPage prop changes\", () => {\n    const updateActivePage = jest.fn();\n\n    const { rerender } = render(\n      <"+"OurPagination\n        totalPages={5}\n        updateActivePage={updateActivePage}\n        currentPage={1}\n      />,\n    );\n\n    // Page 1 should be active\n    expect(screen.getByTestId(\"OurPagination-1\").parentElement).toHaveClass(\n      \"active\",\n    );\n\n    // Rerender with currentPage=3\n    rerender(\n      <"+"OurPagination\n        totalPages={5}\n        updateActivePage={updateActivePage}\n        currentPage={3}\n      />,\n    );\n\n    // Page 3 should now be active\n    expect(screen.getByTestId(\"OurPagination-3\").parentElement).toHaveClass(\n      \"active\",\n    );\n  });\n});\n"},"src/tests/components/Jobs/JobsTable.test.js":{"tests":[{"id":"101","name":"JobsTable tests renders without crashing for empty table","location":{"start":{"column":4,"line":10}}},{"id":"102","name":"JobsTable tests Has the expected column headers and content","location":{"start":{"column":4,"line":20}}},{"id":"103","name":"JobsTable tests renders short logs correctly","location":{"start":{"column":4,"line":64}}},{"id":"104","name":"JobsTable tests renders long logs and handles truncation","location":{"start":{"column":4,"line":87}}},{"id":"105","name":"JobsTable tests renders long logs and handles truncation (snapshot)","location":{"start":{"column":4,"line":119}}},{"id":"106","name":"JobsTable tests does not show 'See entire log' for logs of exactly 10 lines","location":{"start":{"column":4,"line":143}}},{"id":"107","name":"JobsTable tests displays 'No logs available' when log is empty or null","location":{"start":{"column":4,"line":172}}}],"source":"import { render, screen } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\nimport JobsTable from \"main/components/Jobs/JobsTable\";\nimport jobsFixtures from \"fixtures/jobsFixtures\";\n\ndescribe(\"JobsTable tests\", () => {\n  const queryClient = new QueryClient();\n\n  test(\"renders without crashing for empty table\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"JobsTable jobs={[]} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n  });\n\n  test(\"Has the expected column headers and content\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"JobsTable jobs={jobsFixtures.sixJobs} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const expectedHeaders = [\"id\", \"Created\", \"Updated\", \"Status\", \"Log\"];\n    const expectedFields = [\"id\", \"Created\", \"Updated\", \"status\", \"Log\"];\n    const testId = \"JobsTable\";\n\n    expectedHeaders.forEach((headerText) => {\n      const header = screen.getByText(headerText);\n      expect(header).toBeInTheDocument();\n    });\n\n    expectedFields.forEach((field) => {\n      const header = screen.getByTestId(`${testId}-cell-row-0-col-${field}`);\n      expect(header).toBeInTheDocument();\n    });\n\n    expect(screen.getByTestId(`${testId}-cell-row-0-col-id`)).toHaveTextContent(\n      \"1\",\n    );\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-Created`),\n    ).toHaveTextContent(\"1\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-Updated`),\n    ).toHaveTextContent(\"11/13/2022, 19:49:59\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-status`),\n    ).toHaveTextContent(\"complete\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-Log`),\n    ).toHaveTextContent(\"Hello World! from test job! Goodbye from test job!\");\n\n    expect(\n      screen.getByTestId(`JobsTable-header-id-sort-carets`),\n    ).toHaveTextContent(\"\");\n  });\n\n  test(\"renders short logs correctly\", () => {\n    const jobsWithShortLog = [\n      {\n        id: 1,\n        createdAt: \"2023-11-01T12:00:00Z\",\n        updatedAt: \"2023-11-01T12:30:00Z\",\n        status: \"pending\",\n        log: \"Single line log\",\n      },\n    ];\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"JobsTable jobs={jobsWithShortLog} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const logCell = screen.getByTestId(\"JobsTable-cell-row-0-col-Log\");\n    expect(logCell).toHaveTextContent(\"Single line log\");\n  });\n\n  test(\"renders long logs and handles truncation\", () => {\n    const jobsWithLongLog = [\n      {\n        id: 2,\n        createdAt: \"2023-11-01T12:00:00Z\",\n        updatedAt: \"2023-11-01T12:30:00Z\",\n        status: \"in-progress\",\n        log: \"Line \\n\".repeat(15), // Long log of 15 lines\n      },\n    ];\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"JobsTable jobs={jobsWithLongLog} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const logCell = screen.getByTestId(\"JobsTable-cell-row-0-col-Log\");\n    const truncatedLog = jobsWithLongLog[0].log\n      .split(\"\\n\")\n      .slice(0, 10)\n      .join(\"\");\n\n    expect(logCell).toHaveTextContent(truncatedLog.replace(/\\n/g, \"\"));\n\n    const link = screen.getByRole(\"link\", { name: /See entire log/i });\n    expect(link).toBeInTheDocument();\n    expect(link).toHaveAttribute(\"href\", \"/admin/jobs/logs/2\");\n  });\n\n  test(\"renders long logs and handles truncation (snapshot)\", () => {\n    const queryClient = new QueryClient();\n    const jobsWithLongLog = [\n      {\n        id: 2,\n        createdAt: \"2023-11-01T12:00:00Z\",\n        updatedAt: \"2023-11-01T12:30:00Z\",\n        status: \"in-progress\",\n        log: \"Line \\n\".repeat(15),\n      },\n    ];\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"JobsTable jobs={jobsWithLongLog} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const logCell = screen.getByTestId(\"JobsTable-cell-row-0-col-Log\");\n    expect(logCell).toMatchSnapshot();\n  });\n\n  test(\"does not show 'See entire log' for logs of exactly 10 lines\", () => {\n    const jobsWithExact10Lines = [\n      {\n        id: 2,\n        createdAt: \"2023-11-01T12:00:00Z\",\n        updatedAt: \"2023-11-01T12:30:00Z\",\n        status: \"in-progress\",\n        log: \"Line \\n\".repeat(9),\n      },\n    ];\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"JobsTable jobs={jobsWithExact10Lines} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const logCell = screen.getByTestId(\"JobsTable-cell-row-0-col-Log\");\n    expect(logCell).toHaveTextContent(\n      \"Line Line Line Line Line Line Line Line Line\",\n    );\n\n    // The 'See entire log' link should NOT be present\n    const link = screen.queryByRole(\"link\", { name: /See entire log/i });\n    expect(link).not.toBeInTheDocument();\n  });\n\n  test(\"displays 'No logs available' when log is empty or null\", () => {\n    const jobsWithEmptyLog = [\n      {\n        id: 3,\n        createdAt: \"2023-11-01T12:00:00Z\",\n        updatedAt: \"2023-11-01T12:30:00Z\",\n        status: \"complete\",\n        log: null,\n      },\n      {\n        id: 4,\n        createdAt: \"2023-11-01T12:00:00Z\",\n        updatedAt: \"2023-11-01T12:30:00Z\",\n        status: \"complete\",\n        log: \"\",\n      },\n    ];\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"JobsTable jobs={jobsWithEmptyLog} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const logCell1 = screen.getByTestId(\"JobsTable-cell-row-0-col-Log\");\n    const logCell2 = screen.getByTestId(\"JobsTable-cell-row-1-col-Log\");\n\n    expect(logCell1).toHaveTextContent(\"No logs available\");\n    expect(logCell2).toHaveTextContent(\"No logs available\");\n  });\n});\n"},"src/tests/components/PersonalSections/PersonalSectionsTable.test.js":{"tests":[{"id":"108","name":"UserTable tests renders without crashing for empty table with user not logged in","location":{"start":{"column":4,"line":26}}},{"id":"109","name":"UserTable tests renders without crashing for empty table for ordinary user","location":{"start":{"column":4,"line":41}}},{"id":"110","name":"UserTable tests renders without crashing for empty table for admin","location":{"start":{"column":4,"line":56}}},{"id":"111","name":"UserTable tests Has the expected column headers and content","location":{"start":{"column":4,"line":71}}},{"id":"112","name":"UserTable tests Delete button calls delete callback for ordinary user","location":{"start":{"column":4,"line":162}}}],"source":"import { fireEvent, render, screen, waitFor } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\n\nimport PersonalSectionsTable from \"main/components/PersonalSections/PersonalSectionsTable\";\nimport { currentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { personalSectionsFixtures } from \"fixtures/personalSectionsFixtures\";\n\nconst mockedNavigate = jest.fn();\n\njest.mock(\"react-router-dom\", () => ({\n  ...jest.requireActual(\"react-router-dom\"),\n  useNavigate: () => mockedNavigate,\n}));\n\nconst mockedMutate = jest.fn();\n\njest.mock(\"main/utils/useBackend\", () => ({\n  ...jest.requireActual(\"main/utils/useBackend\"),\n  useBackendMutation: () => ({ mutate: mockedMutate }),\n}));\n\ndescribe(\"UserTable tests\", () => {\n  const queryClient = new QueryClient();\n\n  test(\"renders without crashing for empty table with user not logged in\", () => {\n    const currentUser = null;\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"PersonalSectionsTable\n            personalSections={[]}\n            currentUser={currentUser}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n  });\n\n  test(\"renders without crashing for empty table for ordinary user\", () => {\n    const currentUser = currentUserFixtures.userOnly;\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"PersonalSectionsTable\n            personalSections={[]}\n            currentUser={currentUser}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n  });\n\n  test(\"renders without crashing for empty table for admin\", () => {\n    const currentUser = currentUserFixtures.adminUser;\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"PersonalSectionsTable\n            personalSections={[]}\n            currentUser={currentUser}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n  });\n\n  test(\"Has the expected column headers and content\", async () => {\n    const currentUser = currentUserFixtures.userOnly;\n    const psId = 1;\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"PersonalSectionsTable\n            personalSections={personalSectionsFixtures.threePersonalSections}\n            psId={psId}\n            currentUser={currentUser}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const expectedHeaders = [\n      \"Course ID\",\n      \"Enroll Code\",\n      \"Section\",\n      \"Title\",\n      \"Enrolled\",\n      \"Location\",\n      \"Days\",\n      \"Time\",\n      \"Instructor\",\n    ];\n    const expectedFields = [\n      \"courseId\",\n      \"classSections[0].enrollCode\",\n      \"classSections[0].section\",\n      \"title\",\n      \"enrolled\",\n      \"location\",\n      \"classSections[0].timeLocations[0].days\",\n      \"time\",\n      \"instructor\",\n    ];\n    const testId = \"PersonalSectionsTable\";\n\n    expectedHeaders.forEach((headerText) => {\n      const header = screen.getByText(headerText);\n      expect(header).toBeInTheDocument();\n    });\n\n    expectedFields.forEach((field) => {\n      const header = screen.getByTestId(`${testId}-cell-row-0-col-${field}`);\n      expect(header).toBeInTheDocument();\n    });\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-courseId`),\n    ).toHaveTextContent(\"ECE 1A\");\n    expect(\n      screen.getByTestId(\n        `${testId}-cell-row-0-col-classSections[0].enrollCode`,\n      ),\n    ).toHaveTextContent(\"12583\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-classSections[0].section`),\n    ).toHaveTextContent(\"0100\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-title`),\n    ).toHaveTextContent(\"COMP ENGR SEMINAR\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-enrolled`),\n    ).toHaveTextContent(\"84/100\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-location`),\n    ).toHaveTextContent(\"BUCHN 1930\");\n    expect(\n      screen.getByTestId(\n        `${testId}-cell-row-0-col-classSections[0].timeLocations[0].days`,\n      ),\n    ).toHaveTextContent(\"M\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-time`),\n    ).toHaveTextContent(\"3:00 PM - 3:50 PM\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-instructor`),\n    ).toHaveTextContent(\"WANG L C\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-2-col-instructor`),\n    ).toHaveTextContent(\"STEPHANSON B, BUCKWALTER J\");\n\n    const deleteButton = screen.getByTestId(\n      `PersonalSectionsTable-cell-row-0-col-Delete-button`,\n    );\n    expect(deleteButton).toBeInTheDocument();\n    expect(deleteButton).toHaveClass(\"btn-danger\");\n  });\n\n  test(\"Delete button calls delete callback for ordinary user\", async () => {\n    const testId = \"PersonalSectionsTable\";\n    const currentUser = currentUserFixtures.userOnly;\n    const psId = 1;\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"PersonalSectionsTable\n            personalSections={personalSectionsFixtures.threePersonalSections}\n            psId={psId}\n            currentUser={currentUser}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(\n      await screen.findByTestId(`${testId}-cell-row-0-col-courseId`),\n    ).toHaveTextContent(\"ECE 1A\");\n\n    const deleteButton = screen.getByTestId(\n      `PersonalSectionsTable-cell-row-0-col-Delete-button`,\n    );\n    expect(deleteButton).toBeInTheDocument();\n\n    fireEvent.click(deleteButton);\n\n    await waitFor(() => expect(mockedMutate).toHaveBeenCalledTimes(1));\n  });\n});\n"},"src/tests/pages/PersonalSchedules/PersonalSchedulesDetailsPage.test.js":{"tests":[{"id":"113","name":"PersonalSchedulesDetailsPage tests renders without crashing for regular user","location":{"start":{"column":4,"line":63}}},{"id":"114","name":"PersonalSchedulesDetailsPage tests shows the correct info for admin users","location":{"start":{"column":4,"line":76}}},{"id":"115","name":"PersonalSchedulesDetailsPage tests renders 'Back' button","location":{"start":{"column":4,"line":159}}}],"source":"import { render, screen, waitFor } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport PersonalSchedulesDetailsPage from \"main/pages/PersonalSchedules/PersonalSchedulesDetailsPage\";\nimport { personalScheduleFixtures } from \"fixtures/personalScheduleFixtures\";\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport userEvent from \"@testing-library/user-event\";\n\nconst mockNavigate = jest.fn();\njest.mock(\"react-router-dom\", () => {\n  const originalModule = jest.requireActual(\"react-router-dom\");\n  return {\n    __esModule: true,\n    ...originalModule,\n    useParams: () => ({\n      id: 17,\n    }),\n    Navigate: (x) => {\n      mockNavigate(x);\n      return null;\n    },\n  };\n});\n\nconst mockToast = jest.fn();\njest.mock(\"react-toastify\", () => {\n  const originalModule = jest.requireActual(\"react-toastify\");\n  return {\n    __esModule: true,\n    ...originalModule,\n    toast: (x) => mockToast(x),\n  };\n});\n\ndescribe(\"PersonalSchedulesDetailsPage tests\", () => {\n  const axiosMock = new AxiosMockAdapter(axios);\n\n  const testId = \"PersonalSchedulesTable\";\n\n  const setupAdminUser = () => {\n    axiosMock.reset();\n    axiosMock.resetHistory();\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.adminUser);\n    axiosMock\n      .onGet(\"/api/systemInfo\")\n      .reply(200, systemInfoFixtures.showingNeither);\n  };\n\n  beforeEach(() => {\n    jest.spyOn(console, \"error\");\n    console.error.mockImplementation(() => null);\n  });\n\n  afterEach(() => {\n    console.error.mockRestore();\n  });\n\n  test(\"renders without crashing for regular user\", () => {\n    const queryClient = new QueryClient();\n    axiosMock.onGet(\"/api/personalschedules/all\").reply(200, []);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"PersonalSchedulesDetailsPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n  });\n\n  test(\"shows the correct info for admin users\", async () => {\n    setupAdminUser();\n    const queryClient = new QueryClient();\n    axiosMock\n      .onGet(`/api/personalschedules?id=17`)\n      .reply(200, personalScheduleFixtures.onePersonalScheduleDiffId);\n    axiosMock\n      .onGet(`api/personalSections/all?psId=17`)\n      .reply(200, personalScheduleFixtures.threePersonalSchedulesDiffId);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"PersonalSchedulesDetailsPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n    await waitFor(() => {\n      expect(\n        screen.getByText(\"Personal Schedules Details\"),\n      ).toBeInTheDocument();\n    });\n    await waitFor(() => {\n      expect(\n        screen.getByText(\"Sections in Personal Schedule\"),\n      ).toBeInTheDocument();\n    });\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(\"PersonalSchedulesTable-cell-row-0-col-id\"),\n      ).toHaveTextContent(\"17\");\n    });\n\n    await waitFor(() => {\n      expect(\n        screen.getByTestId(\"PersonalSectionsTable-cell-row-0-col-courseId\"),\n      ).toHaveTextContent(\"ECE 1A\");\n    });\n\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-description`),\n    ).toHaveTextContent(\"My Winter Courses\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-name`),\n    ).toHaveTextContent(\"CS156\");\n    expect(\n      screen.getByTestId(\n        `PersonalSectionsTable-cell-row-0-col-classSections[0].enrollCode`,\n      ),\n    ).toHaveTextContent(\"12583\");\n    expect(\n      screen.getByTestId(\n        `PersonalSectionsTable-cell-row-0-col-classSections[0].section`,\n      ),\n    ).toHaveTextContent(\"0100\");\n    expect(\n      screen.getByTestId(`PersonalSectionsTable-cell-row-0-col-title`),\n    ).toHaveTextContent(\"COMP ENGR SEMINAR\");\n    expect(\n      screen.getByTestId(`PersonalSectionsTable-cell-row-0-col-enrolled`),\n    ).toHaveTextContent(\"84/100\");\n    expect(\n      screen.getByTestId(`PersonalSectionsTable-cell-row-0-col-location`),\n    ).toHaveTextContent(\"BUCHN 1930\");\n    expect(\n      screen.getByTestId(\n        `PersonalSectionsTable-cell-row-0-col-classSections[0].timeLocations[0].days`,\n      ),\n    ).toHaveTextContent(\"M\");\n    expect(\n      screen.getByTestId(`PersonalSectionsTable-cell-row-0-col-time`),\n    ).toHaveTextContent(\"3:00 PM - 3:50 PM\");\n    expect(\n      screen.getByTestId(`PersonalSectionsTable-cell-row-0-col-instructor`),\n    ).toHaveTextContent(\"WANG L C\");\n\n    const deleteButton = screen.getByTestId(\n      `PersonalSectionsTable-cell-row-0-col-Delete-button`,\n    );\n    expect(deleteButton).toBeInTheDocument();\n    expect(deleteButton).toHaveClass(\"btn-danger\");\n  });\n\n  test(\"renders 'Back' button\", () => {\n    const queryClient = new QueryClient();\n    axiosMock.onGet(`/api/personalschedules?id=17`).reply(200, []);\n    axiosMock.onGet(`api/personalSections/all?psId=17`).reply(200, []);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"PersonalSchedulesDetailsPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const backButton = screen.getByRole(\"button\", { name: /back/i });\n    expect(backButton).toBeInTheDocument();\n\n    // Optional: Test button functionality\n    userEvent.click(backButton);\n    // Add your assertions here to ensure that clicking the button triggers the expected action.\n  });\n});\n"},"src/tests/components/SectionsTableBase.test.js":{"tests":[{"id":"118","name":"SectionsTableBase tests renders an empty table without crashing","location":{"start":{"column":4,"line":110}}},{"id":"119","name":"SectionsTableBase tests renders an full table without crashing","location":{"start":{"column":4,"line":114}}},{"id":"120","name":"SectionsTableBase tests renders a single lecture section correctly","location":{"start":{"column":4,"line":120}}},{"id":"121","name":"SectionsTableBase tests renders five sections (one with no discussion then lecture with three discussions) correctly","location":{"start":{"column":4,"line":133}}},{"id":"122","name":"SectionsTableBase tests renders rows with alternating background colors correctly","location":{"start":{"column":4,"line":150}}}],"source":"import { render, screen } from \"@testing-library/react\";\nimport SectionsTableBase from \"main/components/SectionsTableBase\";\nimport {\n  oneLectureSectionWithNoDiscussion,\n  gigaSections,\n  fiveSections,\n} from \"fixtures/sectionFixtures\";\nimport { yyyyqToQyy } from \"main/utils/quarterUtilities.js\";\nimport {\n  convertToFraction,\n  formatDays,\n  formatInstructors,\n  formatLocation,\n  formatTime,\n  isSection,\n} from \"main/utils/sectionUtils.js\";\n\ndescribe(\"SectionsTableBase tests\", () => {\n  function getFirstVal(values) {\n    return values[0];\n  }\n\n  const columns = [\n    {\n      Header: \"Quarter\",\n      accessor: (row) => yyyyqToQyy(row.courseInfo.quarter),\n      disableGroupBy: true,\n      id: \"quarter\",\n\n      aggregate: getFirstVal,\n      Aggregated: ({ cell: { value } }) => `${value}`,\n    },\n    {\n      Header: \"Course ID\",\n      accessor: \"courseInfo.courseId\",\n\n      Cell: ({ cell: { value } }) => value.substring(0, value.length - 2),\n    },\n    {\n      Header: \"Title\",\n      accessor: \"courseInfo.title\",\n      disableGroupBy: true,\n\n      aggregate: getFirstVal,\n      Aggregated: ({ cell: { value } }) => `${value}`,\n    },\n    {\n      // Stryker disable next-line StringLiteral: this column is hidden, very hard to test\n      Header: \"Is Section?\",\n      accessor: (row) => isSection(row.section.section),\n      // Stryker disable next-line StringLiteral: this column is hidden, very hard to test\n      id: \"isSection\",\n    },\n    {\n      Header: \"Enrolled\",\n      accessor: (row) =>\n        convertToFraction(row.section.enrolledTotal, row.section.maxEnroll),\n      disableGroupBy: true,\n      id: \"enrolled\",\n\n      aggregate: getFirstVal,\n      Aggregated: ({ cell: { value } }) => `${value}`,\n    },\n    {\n      Header: \"Location\",\n      accessor: (row) => formatLocation(row.section.timeLocations),\n      disableGroupBy: true,\n      id: \"location\",\n\n      aggregate: getFirstVal,\n      Aggregated: ({ cell: { value } }) => `${value}`,\n    },\n    {\n      Header: \"Days\",\n      accessor: (row) => formatDays(row.section.timeLocations),\n      disableGroupBy: true,\n      id: \"days\",\n\n      aggregate: getFirstVal,\n      Aggregated: ({ cell: { value } }) => `${value}`,\n    },\n    {\n      Header: \"Time\",\n      accessor: (row) => formatTime(row.section.timeLocations),\n      disableGroupBy: true,\n      id: \"time\",\n\n      aggregate: getFirstVal,\n      Aggregated: ({ cell: { value } }) => `${value}`,\n    },\n    {\n      Header: \"Instructor\",\n      accessor: (row) => formatInstructors(row.section.instructors),\n      disableGroupBy: true,\n      id: \"instructor\",\n\n      aggregate: getFirstVal,\n      Aggregated: ({ cell: { value } }) => `${value}`,\n    },\n    {\n      Header: \"Enroll Code\",\n      accessor: \"section.enrollCode\",\n      disableGroupBy: true,\n\n      aggregate: getFirstVal,\n      Aggregated: ({ cell: { value } }) => `${value}`,\n    },\n  ];\n\n  test(\"renders an empty table without crashing\", () => {\n    render(<"+"SectionsTableBase columns={columns} data={[]} group={false} />);\n  });\n\n  test(\"renders an full table without crashing\", () => {\n    render(\n      <"+"SectionsTableBase columns={columns} data={gigaSections} group={false} />,\n    );\n  });\n\n  test(\"renders a single lecture section correctly\", async () => {\n    render(\n      <"+"SectionsTableBase\n        columns={columns}\n        data={oneLectureSectionWithNoDiscussion}\n        group={false}\n      />,\n    );\n\n    expect(screen.queryByText(\"\")).not.toBeInTheDocument();\n    expect(screen.queryByText(\"\")).not.toBeInTheDocument();\n  });\n\n  test(\"renders five sections (one with no discussion then lecture with three discussions) correctly\", async () => {\n    render(\n      <"+"SectionsTableBase columns={columns} data={fiveSections} group={false} />,\n    );\n\n    expect(screen.getByText(\"\")).toBeInTheDocument();\n    expect(screen.queryByText(\"\")).not.toBeInTheDocument();\n    expect(\n      screen.getByTestId(\n        \"testid-cell-row-1-col-courseInfo.courseId-expand-symbols\",\n      ),\n    ).toBeInTheDocument();\n    expect(\n      screen.getByTestId(\"testid-cell-row-0-col-courseInfo.courseId\"),\n    ).toHaveAttribute(\"style\", \"color: rgb(74, 79, 79); font-weight: bold;\");\n  });\n\n  test(\"renders rows with alternating background colors correctly\", async () => {\n    render(\n      <"+"SectionsTableBase columns={columns} data={gigaSections} group={false} />,\n    );\n\n    // Check the background color of the first few rows\n    const rows = [\n      screen\n        .getByTestId(\"testid-cell-row-0-col-courseInfo.courseId\")\n        .closest(\"tr\"),\n      screen\n        .getByTestId(\"testid-cell-row-1-col-courseInfo.courseId\")\n        .closest(\"tr\"),\n      screen\n        .getByTestId(\"testid-cell-row-2-col-courseInfo.courseId\")\n        .closest(\"tr\"),\n      screen\n        .getByTestId(\"testid-cell-row-3-col-courseInfo.courseId\")\n        .closest(\"tr\"),\n    ];\n\n    // Expected background colors\n    const expectedBackgroundColors = [\n      \"rgb(227, 235, 252)\", // #e3ebfc in RGB format\n      \"rgb(255, 255, 255)\", // #ffffff in RGB format\n      \"rgb(227, 235, 252)\", // #e3ebfc in RGB format\n      \"rgb(255, 255, 255)\", // #ffffff in RGB format\n    ];\n\n    // Verify the background colors for each row\n    rows.forEach((row, index) => {\n      const style = window.getComputedStyle(row);\n      expect(style.backgroundColor).toBe(expectedBackgroundColors[index]);\n    });\n  });\n});\n"},"src/tests/pages/CourseOverTime/CourseOverTimeIndexPage.test.js":{"tests":[{"id":"123","name":"CourseOverTimeIndexPage tests renders without crashing","location":{"start":{"column":4,"line":41}}},{"id":"124","name":"CourseOverTimeIndexPage tests calls UCSB Course over time search api correctly with 3 section response","location":{"start":{"column":4,"line":51}}},{"id":"125","name":"CourseOverTimeIndexPage tests passes sorted sections to SectionsOverTimeTable","location":{"start":{"column":4,"line":102}}}],"source":"import { render, screen, waitFor } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\n\nimport CourseOverTimeIndexPage from \"main/pages/CourseOverTime/CourseOverTimeIndexPage\";\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport {\n  threeSections,\n  differentQuarterSections,\n} from \"fixtures/sectionFixtures\";\nimport { allTheSubjects } from \"fixtures/subjectFixtures\";\nimport userEvent from \"@testing-library/user-event\";\n\nconst mockToast = jest.fn();\njest.mock(\"react-toastify\", () => {\n  const originalModule = jest.requireActual(\"react-toastify\");\n  return {\n    __esModule: true,\n    ...originalModule,\n    toast: (x) => mockToast(x),\n  };\n});\n\ndescribe(\"CourseOverTimeIndexPage tests\", () => {\n  const axiosMock = new AxiosMockAdapter(axios);\n\n  beforeEach(() => {\n    axiosMock.resetHistory();\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.userOnly);\n    axiosMock\n      .onGet(\"/api/systemInfo\")\n      .reply(200, systemInfoFixtures.showingNeither);\n  });\n\n  const queryClient = new QueryClient();\n  test(\"renders without crashing\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeIndexPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n  });\n\n  test(\"calls UCSB Course over time search api correctly with 3 section response\", async () => {\n    axiosMock.onGet(\"/api/UCSBSubjects/all\").reply(200, allTheSubjects);\n    axiosMock\n      .onGet(\"/api/public/courseovertime/search\")\n      .reply(200, threeSections);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeIndexPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const selectStartQuarter = screen.getByLabelText(\"Start Quarter\");\n    userEvent.selectOptions(selectStartQuarter, \"20222\");\n    const selectEndQuarter = screen.getByLabelText(\"End Quarter\");\n    userEvent.selectOptions(selectEndQuarter, \"20222\");\n    const selectSubject = screen.getByLabelText(\"Subject Area\");\n\n    const expectedKey = \"CourseOverTimeSearch.Subject-option-ANTH\";\n    await waitFor(() =>\n      expect(screen.getByTestId(expectedKey).toBeInTheDocument),\n    );\n\n    userEvent.selectOptions(selectSubject, \"ANTH\");\n    const enterCourseNumber = screen.getByLabelText(\n      \"Course Number (Try searching '16' or '130A')\",\n    );\n    userEvent.type(enterCourseNumber, \"130A\");\n\n    const submitButton = screen.getByText(\"Submit\");\n    expect(submitButton).toBeInTheDocument();\n    userEvent.click(submitButton);\n\n    axiosMock.resetHistory();\n\n    await waitFor(() => {\n      expect(axiosMock.history.get.length).toBeGreaterThanOrEqual(1);\n    });\n\n    expect(axiosMock.history.get[0].params).toEqual({\n      startQtr: \"20222\",\n      endQtr: \"20222\",\n      subjectArea: \"ANTH\",\n      courseNumber: \"130A\",\n    });\n\n    expect(screen.getByText(\"ECE 1A\")).toBeInTheDocument();\n  });\n\n  test(\"passes sorted sections to SectionsOverTimeTable\", async () => {\n    // Mock the response of the API call with differentQuarterSections data\n    axiosMock.onGet(\"/api/UCSBSubjects/all\").reply(200, allTheSubjects);\n    axiosMock\n      .onGet(\"/api/public/courseovertime/search\")\n      .reply(200, differentQuarterSections);\n\n    const spy = jest.spyOn(\n      require(\"main/components/Sections/SectionsOverTimeTable\"),\n      \"default\",\n    );\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeIndexPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const selectStartQuarter = screen.getByLabelText(\"Start Quarter\");\n    userEvent.selectOptions(selectStartQuarter, \"20222\");\n    const selectEndQuarter = screen.getByLabelText(\"End Quarter\");\n    userEvent.selectOptions(selectEndQuarter, \"20222\");\n    const selectSubject = screen.getByLabelText(\"Subject Area\");\n\n    const expectedKey = \"CourseOverTimeSearch.Subject-option-ANTH\";\n    await waitFor(() =>\n      expect(screen.getByTestId(expectedKey).toBeInTheDocument),\n    );\n\n    userEvent.selectOptions(selectSubject, \"ANTH\");\n    const enterCourseNumber = screen.getByLabelText(\n      \"Course Number (Try searching '16' or '130A')\",\n    );\n    userEvent.type(enterCourseNumber, \"130A\");\n\n    const submitButton = screen.getByText(\"Submit\");\n    expect(submitButton).toBeInTheDocument();\n    userEvent.click(submitButton);\n\n    axiosMock.resetHistory();\n\n    await waitFor(() => {\n      expect(axiosMock.history.get.length).toBeGreaterThanOrEqual(1);\n    });\n\n    expect(axiosMock.history.get[0].params).toEqual({\n      startQtr: \"20222\",\n      endQtr: \"20222\",\n      subjectArea: \"ANTH\",\n      courseNumber: \"130A\",\n    });\n\n    // Check that SectionsOverTimeTable received the sorted sections data\n    const sortedSections = differentQuarterSections.sort((a, b) =>\n      b.courseInfo.quarter.localeCompare(a.courseInfo.quarter),\n    );\n    expect(spy).toHaveBeenCalledWith(\n      { sections: sortedSections },\n      expect.anything(),\n    );\n\n    spy.mockRestore();\n  });\n});\n"},"src/tests/components/PersonalSchedulesWeeklyView/PersonalSchedulesWeeklyViewEvent.test.js":{"tests":[{"id":"126","name":"PersonalSectionsEvents tests renders event with correct styles and popover","location":{"start":{"column":4,"line":21}}},{"id":"127","name":"PersonalSectionsEvents tests renders event with height from 12:00 to 12:10 with font size null","location":{"start":{"column":8,"line":107}}},{"id":"128","name":"PersonalSectionsEvents tests renders event with height from 12:00 to 12:20 with font size 10px","location":{"start":{"column":8,"line":107}}},{"id":"129","name":"PersonalSectionsEvents tests renders event with height from 12:00 to 12:30 with font size 12px","location":{"start":{"column":8,"line":107}}},{"id":"130","name":"PersonalSectionsEvents tests renders event with height from 12:00 to 12:40 with font size 14px","location":{"start":{"column":8,"line":107}}},{"id":"131","name":"PersonalSectionsEvents tests renders event with height from 12:00 to 13:00 with font size 16px","location":{"start":{"column":8,"line":107}}},{"id":"132","name":"PersonalSectionsEvents tests renders event with height from 12:00 to 14:00 with font size 16px","location":{"start":{"column":8,"line":107}}},{"id":"133","name":"PersonalSectionsEvents tests renders event with height from 00:00 to 14:00 with font size 16px","location":{"start":{"column":8,"line":107}}},{"id":"134","name":"PersonalSectionsEvents tests renders event with height from 02:00 to 14:00 with font size 16px","location":{"start":{"column":8,"line":107}}}],"source":"import { render, screen, fireEvent } from \"@testing-library/react\";\nimport { BrowserRouter as Router } from \"react-router-dom\";\n\nimport PersonalSectionsEvents from \"main/components/PersonalSchedulesWeeklyView/PersonalSchedulesWeeklyViewEvent\";\nimport { personalSectionsEventsFixtures } from \"fixtures/personalSectionsEventsFixtures\";\n\nimport { QueryClient, QueryClientProvider } from \"react-query\";\n\nconst mockedNavigate = jest.fn();\n\njest.mock(\"react-router-dom\", () => ({\n  ...jest.requireActual(\"react-router-dom\"),\n  useNavigate: () => mockedNavigate,\n}));\n\ndescribe(\"PersonalSectionsEvents tests\", () => {\n  const queryClient = new QueryClient();\n\n  const event = personalSectionsEventsFixtures.oneEvent;\n\n  test(\"renders event with correct styles and popover\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"Router>\n          <"+"PersonalSectionsEvents\n            event={event}\n            eventColor=\"lightblue\"\n            borderColor=\"blue\"\n          />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    // Check if the event is rendered with the correct title\n    expect(screen.getByText(event.title)).toBeInTheDocument();\n\n    // Check if the event card has correct styles\n    const card = screen.getByText(event.title).closest(\".card\");\n    expect(card).toHaveStyle(\"background-color: lightblue\");\n    expect(card).toHaveStyle(\"border: 2px solid blue\");\n\n    expect(screen.getByText(/2:00\\s*-\\s*3:15/)).toBeInTheDocument();\n\n    // Simulate a click to show the popover\n    fireEvent.click(card);\n\n    // Check if the popover content is correct\n    await screen.findByTestId(\"PersonalSectionsEvent-description\");\n    expect(\n      screen.getByTestId(\"PersonalSectionsEvent-description\"),\n    ).toBeInTheDocument();\n  });\n\n  const heights = [\n    {\n      startTime: \"12:00\",\n      endTime: \"12:10\",\n      expectedFontSize: null,\n      expectedHeight: 10,\n    },\n    {\n      startTime: \"12:00\",\n      endTime: \"12:20\",\n      expectedFontSize: \"10px\",\n      expectedHeight: 20,\n    },\n    {\n      startTime: \"12:00\",\n      endTime: \"12:30\",\n      expectedFontSize: \"12px\",\n      expectedHeight: 30,\n    },\n    {\n      startTime: \"12:00\",\n      endTime: \"12:40\",\n      expectedFontSize: \"14px\",\n      expectedHeight: 40,\n    },\n    {\n      startTime: \"12:00\",\n      endTime: \"13:00\",\n      expectedFontSize: \"16px\",\n      expectedHeight: 60,\n    },\n    {\n      startTime: \"12:00\",\n      endTime: \"14:00\",\n      expectedFontSize: \"16px\",\n      expectedHeight: 120,\n    },\n    {\n      startTime: \"00:00\",\n      endTime: \"14:00\",\n      expectedFontSize: \"16px\",\n      expectedHeight: 840,\n    },\n    {\n      startTime: \"02:00\",\n      endTime: \"14:00\",\n      expectedFontSize: \"16px\",\n      expectedHeight: 720,\n    },\n  ];\n\n  heights.forEach(\n    ({ startTime, endTime, expectedFontSize, expectedHeight }) => {\n      test(`renders event with height from ${startTime} to ${endTime} with font size ${expectedFontSize}`, async () => {\n        render(\n          <"+"QueryClientProvider client={queryClient}>\n            <"+"Router>\n              <"+"PersonalSectionsEvents\n                event={{ ...event, startTime, endTime }}\n                eventColor=\"lightblue\"\n                borderColor=\"blue\"\n              />\n            <"+"/Router>\n          <"+"/QueryClientProvider>,\n        );\n\n        // Check if the event card has correct font size\n        /* eslint-disable -- need to check different cards, so conditional expect is necessary */\n        if (expectedFontSize === null) {\n          expect(\n            screen.queryByTestId(\"PersonalSectionsEvent-title\"),\n          ).not.toBeInTheDocument();\n        } else {\n          const cardText = await screen.findByText(event.title);\n          expect(cardText).toHaveStyle(`font-size: ${expectedFontSize}`);\n        }\n\n        // Check if the event card has correct height\n        const card = screen.getByTestId(\"PersonalSectionsEvent-06619\");\n        expect(card).toHaveStyle(`height: ${expectedHeight}px`);\n\n        if (expectedHeight >= 40) {\n          expect(\n            screen.getByTestId(\"PersonalSectionsEvent-title\"),\n          ).toBeInTheDocument();\n          const time = screen.getByTestId(\"PersonalSectionsEvent-time\");\n          expect(time).toBeInTheDocument();\n          expect(time).toHaveStyle(\"font-size: 12px\");\n          expect(time).toHaveStyle(\"text-align: left\");\n        } else if (expectedHeight >= 20) {\n          expect(\n            screen.getByTestId(\"PersonalSectionsEvent-title\"),\n          ).toBeInTheDocument();\n          expect(\n            screen.queryByTestId(\"PersonalSectionsEvent-time\"),\n          ).not.toBeInTheDocument();\n        } else {\n          expect(\n            screen.queryByTestId(\"PersonalSectionsEvent-title\"),\n          ).not.toBeInTheDocument();\n          expect(\n            screen.queryByTestId(\"PersonalSectionsEvent-time\"),\n          ).not.toBeInTheDocument();\n        }\n        /* eslint-enable */\n      });\n    },\n  );\n});\n"},"src/tests/pages/CourseOverTime/CourseOverTimeInstructorIndexPage.test.js":{"tests":[{"id":"135","name":"CourseOverTimeInstructorIndexPage tests renders without crashing","location":{"start":{"column":4,"line":41}}},{"id":"136","name":"CourseOverTimeInstructorIndexPage tests calls UCSB Course over time search api correctly with 3 section response","location":{"start":{"column":4,"line":51}}},{"id":"137","name":"CourseOverTimeInstructorIndexPage tests passes sorted sections to SectionsOverTimeTable","location":{"start":{"column":4,"line":96}}}],"source":"import { render, screen, waitFor } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\n\nimport CourseOverTimeInstructorIndexPage from \"main/pages/CourseOverTime/CourseOverTimeInstructorIndexPage\";\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport {\n  threeSections,\n  differentQuarterSections,\n} from \"fixtures/sectionFixtures\";\nimport { allTheSubjects } from \"fixtures/subjectFixtures\";\nimport userEvent from \"@testing-library/user-event\";\n\nconst mockToast = jest.fn();\njest.mock(\"react-toastify\", () => {\n  const originalModule = jest.requireActual(\"react-toastify\");\n  return {\n    __esModule: true,\n    ...originalModule,\n    toast: (x) => mockToast(x),\n  };\n});\n\ndescribe(\"CourseOverTimeInstructorIndexPage tests\", () => {\n  const axiosMock = new AxiosMockAdapter(axios);\n\n  beforeEach(() => {\n    axiosMock.resetHistory();\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.userOnly);\n    axiosMock\n      .onGet(\"/api/systemInfo\")\n      .reply(200, systemInfoFixtures.showingNeither);\n  });\n\n  const queryClient = new QueryClient();\n  test(\"renders without crashing\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeInstructorIndexPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n  });\n\n  test(\"calls UCSB Course over time search api correctly with 3 section response\", async () => {\n    axiosMock.onGet(\"/api/UCSBSubjects/all\").reply(200, allTheSubjects);\n    axiosMock\n      .onGet(\"/api/public/courseovertime/instructorsearch\")\n      .reply(200, threeSections);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeInstructorIndexPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const selectStartQuarter = screen.getByLabelText(\"Start Quarter\");\n    userEvent.selectOptions(selectStartQuarter, \"20222\");\n    const selectEndQuarter = screen.getByLabelText(\"End Quarter\");\n    userEvent.selectOptions(selectEndQuarter, \"20222\");\n    const enterInstructor = screen.getByLabelText(\"Instructor Name\");\n    userEvent.type(enterInstructor, \"CONRAD\");\n    const selectCheckbox = screen.getByTestId(\n      \"CourseOverTimeInstructorSearchForm-checkbox\",\n    );\n    userEvent.click(selectCheckbox);\n\n    const submitButton = screen.getByText(\"Submit\");\n    expect(submitButton).toBeInTheDocument();\n    userEvent.click(submitButton);\n\n    axiosMock.resetHistory();\n\n    await waitFor(() => {\n      expect(axiosMock.history.get.length).toBeGreaterThanOrEqual(1);\n    });\n\n    expect(axiosMock.history.get[0].params).toEqual({\n      startQtr: \"20222\",\n      endQtr: \"20222\",\n      instructor: \"CONRAD\",\n      lectureOnly: true,\n    });\n\n    expect(screen.getByText(\"ECE 1A\")).toBeInTheDocument();\n  });\n\n  test(\"passes sorted sections to SectionsOverTimeTable\", async () => {\n    // Mock the response of the API call with differentQuarterSections data\n    axiosMock.onGet(\"/api/UCSBSubjects/all\").reply(200, allTheSubjects);\n    axiosMock\n      .onGet(\"/api/public/courseovertime/instructorsearch\")\n      .reply(200, differentQuarterSections);\n\n    const spy = jest.spyOn(\n      require(\"main/components/Sections/SectionsInstructorTable\"),\n      \"default\",\n    );\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeInstructorIndexPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const selectStartQuarter = screen.getByLabelText(\"Start Quarter\");\n    userEvent.selectOptions(selectStartQuarter, \"20222\");\n    const selectEndQuarter = screen.getByLabelText(\"End Quarter\");\n    userEvent.selectOptions(selectEndQuarter, \"20222\");\n    const enterInstructor = screen.getByLabelText(\"Instructor Name\");\n    userEvent.type(enterInstructor, \"CONRAD\");\n    const selectCheckbox = screen.getByTestId(\n      \"CourseOverTimeInstructorSearchForm-checkbox\",\n    );\n    userEvent.click(selectCheckbox);\n\n    const submitButton = screen.getByText(\"Submit\");\n    expect(submitButton).toBeInTheDocument();\n    userEvent.click(submitButton);\n\n    axiosMock.resetHistory();\n\n    await waitFor(() => {\n      expect(axiosMock.history.get.length).toBeGreaterThanOrEqual(1);\n    });\n\n    // Check that SectionsOverTimeTable received the sorted sections data\n    const sortedSections = differentQuarterSections.sort((a, b) =>\n      b.courseInfo.quarter.localeCompare(a.courseInfo.quarter),\n    );\n    expect(spy).toHaveBeenCalledWith(\n      { sections: sortedSections },\n      expect.anything(),\n    );\n\n    spy.mockRestore();\n  });\n});\n"},"src/tests/components/Jobs/JobsSearchForm.test.js":{"tests":[{"id":"138","name":"JobsSearchForm renders all dropdowns with correct labels","location":{"start":{"column":4,"line":16}}},{"id":"139","name":"JobsSearchForm when I select a sortField, the state and localStorage update and callback is called","location":{"start":{"column":4,"line":30}}},{"id":"140","name":"JobsSearchForm when I select a sortDirection, the state and localStorage update and callback is called","location":{"start":{"column":4,"line":48}}},{"id":"141","name":"JobsSearchForm when I select a pageSize, the state and localStorage update and callback is called","location":{"start":{"column":4,"line":66}}},{"id":"142","name":"JobsSearchForm renders correctly when fallback values are used","location":{"start":{"column":4,"line":84}}},{"id":"143","name":"JobsSearchForm uses correct localStorage keys for all dropdowns","location":{"start":{"column":4,"line":99}}},{"id":"144","name":"JobsSearchForm does not use default value if localStorage key is wrong","location":{"start":{"column":4,"line":126}}}],"source":"import { render, screen } from \"@testing-library/react\";\nimport userEvent from \"@testing-library/user-event\";\nimport JobsSearchForm from \"main/components/Jobs/JobsSearchForm\";\n\ndescribe(\"JobsSearchForm\", () => {\n  const updateSortField = jest.fn();\n  const updateSortDirection = jest.fn();\n  const updatePageSize = jest.fn();\n\n  beforeEach(() => {\n    jest.clearAllMocks();\n    jest.spyOn(Storage.prototype, \"setItem\");\n    jest.spyOn(Storage.prototype, \"getItem\").mockImplementation(() => null);\n  });\n\n  test(\"renders all dropdowns with correct labels\", () => {\n    render(\n      <"+"JobsSearchForm\n        updateSortField={updateSortField}\n        updateSortDirection={updateSortDirection}\n        updatePageSize={updatePageSize}\n      />,\n    );\n\n    expect(screen.getByLabelText(\"Sort By\")).toBeInTheDocument();\n    expect(screen.getByLabelText(\"Sort Direction\")).toBeInTheDocument();\n    expect(screen.getByLabelText(\"Page Size\")).toBeInTheDocument();\n  });\n\n  test(\"when I select a sortField, the state and localStorage update and callback is called\", () => {\n    render(\n      <"+"JobsSearchForm\n        updateSortField={updateSortField}\n        updateSortDirection={updateSortDirection}\n        updatePageSize={updatePageSize}\n      />,\n    );\n    const selectSortField = screen.getByLabelText(\"Sort By\");\n    userEvent.selectOptions(selectSortField, \"createdAt\");\n    expect(selectSortField.value).toBe(\"createdAt\");\n    expect(localStorage.setItem).toHaveBeenCalledWith(\n      \"JobsSearch.SortField\",\n      \"createdAt\",\n    );\n    expect(updateSortField).toHaveBeenCalledWith(\"createdAt\");\n  });\n\n  test(\"when I select a sortDirection, the state and localStorage update and callback is called\", () => {\n    render(\n      <"+"JobsSearchForm\n        updateSortField={updateSortField}\n        updateSortDirection={updateSortDirection}\n        updatePageSize={updatePageSize}\n      />,\n    );\n    const selectSortDirection = screen.getByLabelText(\"Sort Direction\");\n    userEvent.selectOptions(selectSortDirection, \"DESC\");\n    expect(selectSortDirection.value).toBe(\"DESC\");\n    expect(localStorage.setItem).toHaveBeenCalledWith(\n      \"JobsSearch.SortDirection\",\n      \"DESC\",\n    );\n    expect(updateSortDirection).toHaveBeenCalledWith(\"DESC\");\n  });\n\n  test(\"when I select a pageSize, the state and localStorage update and callback is called\", () => {\n    render(\n      <"+"JobsSearchForm\n        updateSortField={updateSortField}\n        updateSortDirection={updateSortDirection}\n        updatePageSize={updatePageSize}\n      />,\n    );\n    const selectPageSize = screen.getByLabelText(\"Page Size\");\n    userEvent.selectOptions(selectPageSize, \"100\");\n    expect(selectPageSize.value).toBe(\"100\");\n    expect(localStorage.setItem).toHaveBeenCalledWith(\n      \"JobsSearch.PageSize\",\n      \"100\",\n    );\n    expect(updatePageSize).toHaveBeenCalledWith(\"100\");\n  });\n\n  test(\"renders correctly when fallback values are used\", () => {\n    render(\n      <"+"JobsSearchForm\n        updateSortField={updateSortField}\n        updateSortDirection={updateSortDirection}\n        updatePageSize={updatePageSize}\n      />,\n    );\n\n    // The default values should be selected\n    expect(screen.getByLabelText(\"Sort By\").value).toBe(\"status\");\n    expect(screen.getByLabelText(\"Sort Direction\").value).toBe(\"ASC\");\n    expect(screen.getByLabelText(\"Page Size\").value).toBe(\"5\");\n  });\n\n  test(\"uses correct localStorage keys for all dropdowns\", () => {\n    render(\n      <"+"JobsSearchForm\n        updateSortField={updateSortField}\n        updateSortDirection={updateSortDirection}\n        updatePageSize={updatePageSize}\n      />,\n    );\n\n    userEvent.selectOptions(screen.getByLabelText(\"Sort By\"), \"updatedAt\");\n    userEvent.selectOptions(screen.getByLabelText(\"Sort Direction\"), \"DESC\");\n    userEvent.selectOptions(screen.getByLabelText(\"Page Size\"), \"20\");\n\n    expect(localStorage.setItem).toHaveBeenCalledWith(\n      \"JobsSearch.SortField\",\n      \"updatedAt\",\n    );\n    expect(localStorage.setItem).toHaveBeenCalledWith(\n      \"JobsSearch.SortDirection\",\n      \"DESC\",\n    );\n    expect(localStorage.setItem).toHaveBeenCalledWith(\n      \"JobsSearch.PageSize\",\n      \"20\",\n    );\n  });\n\n  test(\"does not use default value if localStorage key is wrong\", () => {\n    jest.spyOn(Storage.prototype, \"getItem\").mockImplementation((key) => {\n      if (key === \"\") return \"WRONG\";\n      return null;\n    });\n\n    render(\n      <"+"JobsSearchForm\n        updateSortField={updateSortField}\n        updateSortDirection={updateSortDirection}\n        updatePageSize={updatePageSize}\n      />,\n    );\n\n    // The default values should still be selected, not \"WRONG\"\n    expect(screen.getByLabelText(\"Sort By\").value).toBe(\"status\");\n    expect(screen.getByLabelText(\"Sort Direction\").value).toBe(\"ASC\");\n    expect(screen.getByLabelText(\"Page Size\").value).toBe(\"5\");\n  });\n});\n"},"src/tests/pages/CourseOverTime/CourseOverTimeBuildingsIndexPage.test.js":{"tests":[{"id":"145","name":"CourseOverTimeBuildingsIndexPage tests renders without crashing","location":{"start":{"column":4,"line":40}}},{"id":"146","name":"CourseOverTimeBuildingsIndexPage tests calls UCSB Course over time search api correctly with correct response","location":{"start":{"column":4,"line":50}}},{"id":"147","name":"CourseOverTimeBuildingsIndexPage tests calls UCSB Course over time search api correctly with correctly sorted data","location":{"start":{"column":4,"line":95}}}],"source":"import { render, screen, waitFor } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\n\nimport CourseOverTimeBuildingsIndexPage from \"main/pages/CourseOverTime/CourseOverTimeBuildingsIndexPage\";\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport {\n  coursesInLib,\n  coursesInLibDifferentDate,\n} from \"fixtures/buildingFixtures\";\nimport userEvent from \"@testing-library/user-event\";\n\nconst mockToast = jest.fn();\njest.mock(\"react-toastify\", () => {\n  const originalModule = jest.requireActual(\"react-toastify\");\n  return {\n    __esModule: true,\n    ...originalModule,\n    toast: (x) => mockToast(x),\n  };\n});\n\ndescribe(\"CourseOverTimeBuildingsIndexPage tests\", () => {\n  const axiosMock = new AxiosMockAdapter(axios);\n\n  beforeEach(() => {\n    axiosMock.resetHistory();\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.userOnly);\n    axiosMock\n      .onGet(\"/api/systemInfo\")\n      .reply(200, systemInfoFixtures.showingNeither);\n  });\n\n  const queryClient = new QueryClient();\n  test(\"renders without crashing\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeBuildingsIndexPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n  });\n\n  test(\"calls UCSB Course over time search api correctly with correct response\", async () => {\n    axiosMock\n      .onGet(\"/api/public/courseovertime/buildingsearch\")\n      .reply(200, coursesInLib);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeBuildingsIndexPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const selectStartQuarter = screen.getByLabelText(\"Start Quarter\");\n    userEvent.selectOptions(selectStartQuarter, \"20222\");\n    const selectEndQuarter = screen.getByLabelText(\"End Quarter\");\n    userEvent.selectOptions(selectEndQuarter, \"20222\");\n    const selectBuilding = screen.getByLabelText(\"Building Name\");\n\n    const expectedKey = \"CourseOverTimeBuildingsSearch.BuildingCode-option-0\";\n    await waitFor(() =>\n      expect(screen.getByTestId(expectedKey).toBeInTheDocument),\n    );\n\n    userEvent.selectOptions(selectBuilding, \"GIRV\");\n\n    const submitButton = screen.getByText(\"Submit\");\n    expect(submitButton).toBeInTheDocument();\n    userEvent.click(submitButton);\n\n    axiosMock.resetHistory();\n\n    await waitFor(() => {\n      expect(axiosMock.history.get.length).toBeGreaterThanOrEqual(1);\n    });\n\n    expect(axiosMock.history.get[0].params).toEqual({\n      startQtr: \"20222\",\n      endQtr: \"20222\",\n      buildingCode: \"GIRV\",\n    });\n\n    expect(screen.getByText(\"CHEM 184\")).toBeInTheDocument();\n
