  });\n\n  test(\"calls UCSB Course over time search api correctly with correctly sorted data\", async () => {\n    axiosMock\n      .onGet(\"/api/public/courseovertime/buildingsearch\")\n      .reply(200, coursesInLibDifferentDate);\n\n    const spy = jest.spyOn(\n      require(\"main/components/Sections/SectionsTable\"),\n      \"default\",\n    );\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseOverTimeBuildingsIndexPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const selectStartQuarter = screen.getByLabelText(\"Start Quarter\");\n    userEvent.selectOptions(selectStartQuarter, \"20201\");\n    const selectEndQuarter = screen.getByLabelText(\"End Quarter\");\n    userEvent.selectOptions(selectEndQuarter, \"20222\");\n    const selectBuilding = screen.getByLabelText(\"Building Name\");\n\n    const expectedKey = \"CourseOverTimeBuildingsSearch.BuildingCode-option-0\";\n    await waitFor(() =>\n      expect(screen.getByTestId(expectedKey).toBeInTheDocument),\n    );\n\n    userEvent.selectOptions(selectBuilding, \"GIRV\");\n\n    const submitButton = screen.getByText(\"Submit\");\n    expect(submitButton).toBeInTheDocument();\n    userEvent.click(submitButton);\n\n    axiosMock.resetHistory();\n\n    await waitFor(() => {\n      expect(axiosMock.history.get.length).toBeGreaterThanOrEqual(1);\n    });\n\n    expect(axiosMock.history.get[0].params).toEqual({\n      startQtr: \"20201\",\n      endQtr: \"20222\",\n      buildingCode: \"GIRV\",\n    });\n\n    expect(screen.getByText(\"CHEM 184\")).toBeInTheDocument();\n\n    // Check that CoursesOverTimeBuildings received the sorted sections data\n    const sortedSections = coursesInLibDifferentDate.sort((a, b) =>\n      b.courseInfo.quarter.localeCompare(a.courseInfo.quarter),\n    );\n    expect(spy).toHaveBeenCalledWith(\n      { sections: sortedSections },\n      expect.anything(),\n    );\n\n    spy.mockRestore();\n  });\n});\n"},"src/tests/pages/CourseDetails/CourseDetailsIndexPage.test.js":{"tests":[{"id":"148","name":"Course Details Index Page tests renders without crashing","location":{"start":{"column":4,"line":98}}},{"id":"149","name":"Course Details Index Page tests Calls UCSB Section Search api correctly and displays correct information","location":{"start":{"column":4,"line":108}}},{"id":"150","name":"Course Details Index Page tests Calls grade history api correctly and displays correct information","location":{"start":{"column":4,"line":137}}}],"source":"import { render, screen } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\n\nimport CourseDetailsIndexPage from \"main/pages/CourseDetails/CourseDetailsIndexPage\";\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport { personalSectionsFixtures } from \"fixtures/personalSectionsFixtures\";\nimport { oneQuarterCourse } from \"fixtures/gradeHistoryFixtures\";\n\nconst mockToast = jest.fn();\njest.mock(\"react-toastify\", () => {\n  const originalModule = jest.requireActual(\"react-toastify\");\n  return {\n    __esModule: true,\n    ...originalModule,\n    toast: (x) => mockToast(x),\n  };\n});\nconst mockNavigate = jest.fn();\njest.mock(\"react-router-dom\", () => {\n  const originalModule = jest.requireActual(\"react-router-dom\");\n  return {\n    __esModule: true,\n    ...originalModule,\n    useParams: () => ({\n      qtr: \"20221\",\n      enrollCode: \"06619\",\n    }),\n    Navigate: (x) => {\n      mockNavigate(x);\n      return null;\n    },\n  };\n});\n\nclass ResizeObserver {\n  constructor(callback) {\n    this.callback = callback;\n  }\n  observe() {\n    // Mock implementation of the observe method\n  }\n  unobserve() {\n    // Mock implementation of the unobserve method\n  }\n  disconnect() {\n    // Mock implementation of the disconnect method\n  }\n}\n\nwindow.ResizeObserver = ResizeObserver;\n\njest.mock(\"recharts\", () => {\n  const OriginalModule = jest.requireActual(\"recharts\");\n\n  return {\n    ...OriginalModule,\n    ResponsiveContainer: ({ height, children }) => (\n      <"+"OriginalModule.ResponsiveContainer width={800} height={height}>\n        {children}\n      <"+"/OriginalModule.ResponsiveContainer>\n    ),\n  };\n});\n\ndescribe(\"Course Details Index Page tests\", () => {\n  const axiosMock = new AxiosMockAdapter(axios);\n  beforeEach(() => {\n    jest.spyOn(console, \"error\");\n    console.error.mockImplementation(() => null);\n  });\n\n  beforeEach(() => {\n    axiosMock.reset();\n    axiosMock.resetHistory();\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.userOnly);\n    axiosMock\n      .onGet(\"/api/systemInfo\")\n      .reply(200, systemInfoFixtures.showingNeither);\n    axiosMock\n      .onGet(\"/api/sections/sectionsearch\", {\n        params: { qtr: \"20221\", enrollCode: \"06619\" },\n      })\n      .reply(200, personalSectionsFixtures.singleSection);\n    axiosMock\n      .onGet(\"/api/gradehistory/search\", {\n        params: { subjectArea: \"CHEM\", courseNumber: \"184\" },\n      })\n      .reply(200, oneQuarterCourse);\n  });\n\n  const queryClient = new QueryClient();\n  test(\"renders without crashing\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseDetailsIndexPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n  });\n\n  test(\"Calls UCSB Section Search api correctly and displays correct information\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseDetailsIndexPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(\n      screen.getByText(\"Course Details for CHEM 184 W22\"),\n    ).toBeInTheDocument();\n\n    expect(screen.getByText(\"Enroll Code\")).toBeInTheDocument();\n    expect(screen.getByText(\"06619\")).toBeInTheDocument();\n    expect(screen.getByText(\"Section\")).toBeInTheDocument();\n    expect(screen.getByText(\"0100\")).toBeInTheDocument();\n    expect(screen.getByText(\"Title\")).toBeInTheDocument();\n    expect(screen.getByText(\"CHEM LITERATURE\")).toBeInTheDocument();\n    expect(screen.getByText(\"Enrolled\")).toBeInTheDocument();\n    expect(screen.getByText(\"19/24\")).toBeInTheDocument();\n    expect(screen.getByText(\"Location\")).toBeInTheDocument();\n    expect(screen.getByText(\"LIB 1312\")).toBeInTheDocument();\n    expect(screen.getByText(\"Days\")).toBeInTheDocument();\n    expect(screen.getByText(\"T R\")).toBeInTheDocument();\n    expect(screen.getByText(\"Time\")).toBeInTheDocument();\n    expect(screen.getByText(\"2:00 PM - 3:15 PM\")).toBeInTheDocument();\n  });\n\n  test(\"Calls grade history api correctly and displays correct information\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseDetailsIndexPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    expect(screen.getByText(\"Fall 2009 - GONZALEZ T F\")).toBeInTheDocument();\n  });\n});\n"},"src/tests/pages/AdminUpdatesPage.test.js":{"tests":[{"id":"151","name":"AdminUpdatesPage tests Renders expected content","location":{"start":{"column":4,"line":33}}},{"id":"152","name":"AdminUpdatesPage tests When localstorage is empty, fallback values are used","location":{"start":{"column":4,"line":47}}}],"source":"import { render, screen } from \"@testing-library/react\";\nimport AdminUpdatesPage from \"main/pages/Admin/AdminUpdatesPage.js\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\n\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport { allTheSubjects } from \"fixtures/subjectFixtures\";\nimport { updatesFixtures } from \"fixtures/updatesFixtures\";\n\ndescribe(\"AdminUpdatesPage tests\", () => {\n  const axiosMock = new AxiosMockAdapter(axios);\n\n  beforeEach(() => {\n    jest.clearAllMocks();\n    axiosMock.reset();\n    axiosMock.resetHistory();\n    axiosMock\n      .onGet(\"/api/systemInfo\")\n      .reply(200, systemInfoFixtures.showingNeither);\n    axiosMock\n      .onGet(\"/api/updates\")\n      .reply(200, updatesFixtures.threeUpdatesPage);\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.adminUser);\n    axiosMock.onGet(\"/api/UCSBSubjects/all\").reply(200, allTheSubjects);\n  });\n\n  const queryClient = new QueryClient();\n  test(\"Renders expected content\", async () => {\n    // act\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminUpdatesPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    // assert\n    await screen.findByText(\"Updates\");\n  });\n\n  test(\"When localstorage is empty, fallback values are used\", async () => {\n    const getItemSpy = jest.spyOn(Storage.prototype, \"getItem\");\n    getItemSpy.mockImplementation(() => null);\n    const setItemSpy = jest.spyOn(Storage.prototype, \"setItem\");\n\n    const useLocalStorageSpy = jest.spyOn(\n      require(\"main/utils/useLocalStorage\"),\n      \"default\",\n    );\n\n    // act\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"AdminUpdatesPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    await screen.findByText(\"Updates\");\n    expect(setItemSpy).toHaveBeenCalledWith(\"UpdatesSearch.SubjectArea\", \"ALL\");\n    expect(setItemSpy).toHaveBeenCalledWith(\"UpdatesSearch.Quarter\", \"ALL\");\n    expect(setItemSpy).toHaveBeenCalledWith(\n      \"UpdatesSearch.SortField\",\n      \"subjectArea\",\n    );\n    expect(setItemSpy).toHaveBeenCalledWith(\n      \"UpdatesSearch.SortDirection\",\n      \"ASC\",\n    );\n    expect(setItemSpy).toHaveBeenCalledWith(\"UpdatesSearch.PageSize\", \"10\");\n\n    const calls = useLocalStorageSpy.mock.calls;\n    let counts = {};\n    for (const call of calls) {\n      counts[call] = counts[call] ? counts[call] + 1 : 1;\n    }\n\n    expect(counts).toEqual({\n      \"UpdatesSearch.PageSize,10\": 4,\n      \"UpdatesSearch.Quarter,ALL\": 4,\n      \"UpdatesSearch.SortDirection,ASC\": 4,\n      \"UpdatesSearch.SortField,subjectArea\": 4,\n      \"UpdatesSearch.SubjectArea,ALL\": 4,\n    });\n\n    expect(axiosMock.history.get.length).toBe(4);\n    const urls = axiosMock.history.get.map((req) => req.url);\n    expect(urls).toContain(\"/api/systemInfo\");\n    expect(urls).toContain(\"/api/UCSBSubjects/all\");\n    expect(urls).toContain(\"/api/currentUser\");\n    expect(urls).toContain(\"/api/updates\");\n    const updatesRequest = axiosMock.history.get.find(\n      (req) => req.url === \"/api/updates\",\n    );\n    expect(updatesRequest.params).toEqual({\n      quarter: \"ALL\",\n      subjectArea: \"ALL\",\n      page: 0,\n      pageSize: \"10\",\n      sortField: \"subjectArea\",\n      sortDirection: \"ASC\",\n    });\n  });\n});\n"},"src/tests/components/PersonalSchedulesWeeklyView/PersonalSchedulesWeeklyViewPanel.test.js":{"tests":[{"id":"153","name":"PersonalSchedulesWeeklyViewPanel tests renders without crashing","location":{"start":{"column":4,"line":50}}},{"id":"154","name":"PersonalSchedulesWeeklyViewPanel tests renders events on correct days","location":{"start":{"column":4,"line":86}}},{"id":"155","name":"PersonalSchedulesWeeklyViewPanel tests renders without events","location":{"start":{"column":4,"line":112}}}],"source":"import React from \"react\";\nimport { render, screen, within } from \"@testing-library/react\";\nimport { BrowserRouter as Router } from \"react-router-dom\";\n\nimport PersonalSchedulesWeeklyView from \"main/components/PersonalSchedulesWeeklyView/PersonalSchedulesWeeklyViewPanel\";\nimport { personalSectionsEventsFixtures } from \"fixtures/personalSectionsEventsFixtures\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\n\ndescribe(\"PersonalSchedulesWeeklyViewPanel tests\", () => {\n  const queryClient = new QueryClient();\n  const events = personalSectionsEventsFixtures.threeEvents;\n\n  const daysOfWeek = [\n    \"Monday\",\n    \"Tuesday\",\n    \"Wednesday\",\n    \"Thursday\",\n    \"Friday\",\n    \"Saturday\",\n    \"Sunday\",\n  ];\n\n  const hours = [\n    \"\",\n    \"1 AM\",\n    \"2 AM\",\n    \"3 AM\",\n    \"4 AM\",\n    \"5 AM\",\n    \"6 AM\",\n    \"7 AM\",\n    \"8 AM\",\n    \"9 AM\",\n    \"10 AM\",\n    \"11 AM\",\n    \"12 PM\",\n    \"1 PM\",\n    \"2 PM\",\n    \"3 PM\",\n    \"4 PM\",\n    \"5 PM\",\n    \"6 PM\",\n    \"7 PM\",\n    \"8 PM\",\n    \"9 PM\",\n    \"10 PM\",\n    \"11 PM\",\n  ];\n\n  test(\"renders without crashing\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"Router>\n          <"+"PersonalSchedulesWeeklyView />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    daysOfWeek.forEach((day) => {\n      const dayTitle = screen.getByTestId(\n        `PersonalSchedulesWeeklyView-${day}-title`,\n      );\n      expect(dayTitle).toBeInTheDocument();\n      const { getByText } = within(dayTitle);\n      expect(getByText(day)).toBeInTheDocument();\n    });\n\n    hours.forEach((hour) => {\n      const hourSlot = screen.getByTestId(\n        `PersonalSchedulesWeeklyView-${hour.replace(\" \", \"-\")}-title`,\n      );\n      expect(hourSlot).toBeInTheDocument();\n      const { getByTestId } = within(hourSlot);\n      expect(\n        getByTestId(\n          `PersonalSchedulesWeeklyView-${hour.replace(\" \", \"-\")}-label`,\n        ),\n      ).toBeInTheDocument();\n    });\n\n    expect(\n      screen.getAllByTestId(\"PersonalSchedulesWeeklyView-base-slot\").length,\n    ).toBe(161);\n  });\n\n  test(\"renders events on correct days\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"Router>\n          <"+"PersonalSchedulesWeeklyView Events={events} />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    events.forEach((event) => {\n      expect(\n        screen.getAllByTestId(`PersonalSectionsEvent-${event.id}`).length,\n      ).toBe(event.day.length);\n      event.day.forEach((dayElement) => {\n        const dayColumn = screen.getByTestId(\n          `PersonalSchedulesWeeklyView-${dayElement}-column`,\n        );\n        expect(dayColumn).toBeInTheDocument();\n        const { getByTestId } = within(dayColumn);\n        expect(\n          getByTestId(`PersonalSectionsEvent-${event.id}`),\n        ).toBeInTheDocument();\n      });\n    });\n  });\n\n  test(\"renders without events\", async () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"Router>\n          <"+"PersonalSchedulesWeeklyView Events={[]} />\n        <"+"/Router>\n      <"+"/QueryClientProvider>,\n    );\n\n    daysOfWeek.forEach((day) => {\n      expect(screen.getByText(day)).toBeInTheDocument();\n    });\n\n    /* eslint-disable -- hour edge case */\n    hours.forEach((hour) => {\n      if (hour) {\n        expect(screen.getByText(hour)).toBeInTheDocument();\n      }\n    });\n    /* eslint-enable */\n  });\n});\n"},"src/tests/components/CourseDetails/CourseDetailsTable.test.js":{"tests":[{"id":"156","name":"UserTable tests renders without crashing for empty table","location":{"start":{"column":4,"line":24}}},{"id":"157","name":"UserTable tests Has the expected colum headers and content","location":{"start":{"column":4,"line":34}}}],"source":"import { render, screen } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\n\nimport CourseDetailsTable from \"main/components/CourseDetails/CourseDetailsTable\";\nimport { personalSectionsFixtures } from \"fixtures/personalSectionsFixtures\";\n\nconst mockedNavigate = jest.fn();\n\njest.mock(\"react-router-dom\", () => ({\n  ...jest.requireActual(\"react-router-dom\"),\n  useNavigate: () => mockedNavigate,\n}));\n\nconst mockedMutate = jest.fn();\n\njest.mock(\"main/utils/useBackend\", () => ({\n  ...jest.requireActual(\"main/utils/useBackend\"),\n  useBackendMutation: () => ({ mutate: mockedMutate }),\n}));\n\ndescribe(\"UserTable tests\", () => {\n  const queryClient = new QueryClient();\n  test(\"renders without crashing for empty table\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseDetailsTable details={[]} />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n  });\n\n  test(\"Has the expected colum headers and content\", () => {\n    // console.log(oneSection)\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"CourseDetailsTable\n            details={personalSectionsFixtures.threePersonalSections}\n          />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const expectedHeaders = [\n      \"Course ID\",\n      \"Enroll Code\",\n      \"Section\",\n      \"Title\",\n      \"Enrolled\",\n      \"Location\",\n      \"Days\",\n      \"Time\",\n      \"Instructor\",\n    ];\n    const expectedFields = [\n      \"courseId\",\n      \"classSections[0].enrollCode\",\n      \"classSections[0].section\",\n      \"title\",\n      \"enrolled\",\n      \"location\",\n    ];\n    const testId = \"CourseDetailsTable\";\n\n    expectedHeaders.forEach((headerText) => {\n      const header = screen.getByText(headerText);\n      expect(header).toBeInTheDocument();\n    });\n\n    expectedFields.forEach((field) => {\n      const header = screen.getByTestId(`${testId}-cell-row-0-col-${field}`);\n      expect(header).toBeInTheDocument();\n    });\n\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-courseId`),\n    ).toHaveTextContent(\"ECE 1A\");\n    expect(\n      screen.getByTestId(\n        `${testId}-cell-row-0-col-classSections[0].enrollCode`,\n      ),\n    ).toHaveTextContent(\"12583\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-classSections[0].section`),\n    ).toHaveTextContent(\"0100\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-title`),\n    ).toHaveTextContent(\"COMP ENGR SEMINAR\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-location`),\n    ).toHaveTextContent(\"BUCHN 1930\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-instructor`),\n    ).toHaveTextContent(\"WANG L C\");\n    expect(\n      screen.getByTestId(\n        `${testId}-cell-row-0-col-classSections[0].timeLocations[0].days`,\n      ),\n    ).toHaveTextContent(\"M\");\n    expect(\n      screen.getByTestId(`${testId}-cell-row-0-col-time`),\n    ).toHaveTextContent(\"3:00 PM - 3:50 PM\");\n  });\n});\n"},"src/tests/pages/SectionSearches/SectionSearchesIndexPage.test.js":{"tests":[{"id":"158","name":"Section Searches Index Page tests renders without crashing","location":{"start":{"column":4,"line":37}}},{"id":"159","name":"Section Searches Index Page tests calls UCSB section search api correctly with 1 section response","location":{"start":{"column":4,"line":47}}}],"source":"import { render, screen, waitFor } from \"@testing-library/react\";\nimport { QueryClient, QueryClientProvider } from \"react-query\";\nimport { MemoryRouter } from \"react-router-dom\";\nimport axios from \"axios\";\nimport AxiosMockAdapter from \"axios-mock-adapter\";\nimport userEvent from \"@testing-library/user-event\";\n\nimport SectionSearchesIndexPage from \"main/pages/SectionSearches/SectionSearchesIndexPage\";\nimport { oneSection } from \"fixtures/sectionFixtures\";\nimport { apiCurrentUserFixtures } from \"fixtures/currentUserFixtures\";\nimport { allTheSubjects } from \"fixtures/subjectFixtures\";\nimport { systemInfoFixtures } from \"fixtures/systemInfoFixtures\";\n\nconst mockToast = jest.fn();\njest.mock(\"react-toastify\", () => {\n  const originalModule = jest.requireActual(\"react-toastify\");\n  return {\n    __esModule: true,\n    ...originalModule,\n    toast: (x) => mockToast(x),\n  };\n});\n\ndescribe(\"Section Searches Index Page tests\", () => {\n  const axiosMock = new AxiosMockAdapter(axios);\n  beforeEach(() => {\n    axiosMock.resetHistory();\n    axiosMock\n      .onGet(\"/api/currentUser\")\n      .reply(200, apiCurrentUserFixtures.userOnly);\n    axiosMock\n      .onGet(\"/api/systemInfo\")\n      .reply(200, systemInfoFixtures.showingNeither);\n  });\n\n  const queryClient = new QueryClient();\n  test(\"renders without crashing\", () => {\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"SectionSearchesIndexPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n  });\n\n  test(\"calls UCSB section search api correctly with 1 section response\", async () => {\n    axiosMock.onGet(\"/api/UCSBSubjects/all\").reply(200, allTheSubjects);\n    axiosMock.onGet(\"/api/sections/basicsearch\").reply(200, oneSection);\n\n    render(\n      <"+"QueryClientProvider client={queryClient}>\n        <"+"MemoryRouter>\n          <"+"SectionSearchesIndexPage />\n        <"+"/MemoryRouter>\n      <"+"/QueryClientProvider>,\n    );\n\n    const selectQuarter = screen.getByLabelText(\"Quarter\");\n    userEvent.selectOptions(selectQuarter, \"20222\");\n    const selectSubject = screen.getByLabelText(\"Subject Area\");\n\n    const expectedKey = \"BasicSearch.Subject-option-ANTH\";\n    await waitFor(() =>\n      expect(screen.getByTestId(expectedKey).toBeInTheDocument),\n    );\n\n    userEvent.selectOptions(selectSubject, \"ANTH\");\n    const selectLevel = screen.getByLabelText(\"Course Level\");\n    userEvent.selectOptions(selectLevel, \"G\");\n\n    const submitButton = screen.getByText(\"Submit\");\n    expect(submitButton).toBeInTheDocument();\n    userEvent.click(submitButton);\n\n    axiosMock.resetHistory();\n\n    await waitFor(() => {\n      expect(axiosMock.history.get.length).toBeGreaterThanOrEqual(1);\n    });\n\n    expect(axiosMock.history.get[0].params).toEqual({\n      qtr: \"20222\",\n      dept: \"ANTH\",\n      level: \"G\",\n    });\n\n    expect(screen.getByText(\"ECE 1A\")).toBeInTheDocument();\n  });\n});\n"},"src/tests/utils/sectionUtils.test.js":{"tests":[{"id":"160","name":"section utils tests convertToFraction one null test 1","location":{"start":{"column":4,"line":63}}},{"id":"161","name":"section utils tests convertToFraction one null test 2","location":{"start":{"column":4,"line":67}}},{"id":"162","name":"section utils tests isSection true test","location":{"start":{"column":4,"line":71}}},{"id":"163","name":"section utils tests isSection false test","location":{"start":{"column":4,"line":75}}},{"id":"164","name":"section utils tests formatLocation test","location":{"start":{"column":4,"line":79}}},{"id":"165","name":"section utils tests formatDays test 1","location":{"start":{"column":4,"line":83}}},{"id":"166","name":"section utils tests formatDays test 2","location":{"start":{"column":4,"line":87}}},{"id":"167","name":"section utils tests formatTime test 3","location":{"start":{"column":4,"line":91}}},{"id":"168","name":"section utils tests formatInstructors test","location":{"start":{"column":4,"line":97}}},{"id":"169","name":"section utils tests formatLocation null test","location":{"start":{"column":4,"line":100}}},{"id":"170","name":"sectio () => {\n    expect(isSection(\"0104\")).toBe(true);\n  });\n\n  test(\"isSection false test\", () => {\n    expect(isSection(\"0100\")).toBe(false);\n  });\n\n  test(\"formatLocation test\", () => {\n    expect(formatLocation(testTimeLocations)).toBe(\"LOC1 1, LOC2 2\");\n  });\n\n  test(\"formatDays test 1\", () => {\n    expect(formatDays(testTimeLocations)).toBe(\"M W, R F\");\n  });\n\n  test(\"formatDays test 2\", () => {\n    expect(formatDays(testTimeLocations1)).toBe(\"R F\");\n  });\n\n  test(\"formatTime test 3\", () => {\n    expect(formatTime(testTimeLocations)).toBe(\n      \"3:30 PM - 4:45 PM, 10:30 AM - 11:45 AM\",\n    );\n  });\n\n  test(\"formatInstructors test\", () => {\n    expect(formatInstructors(testInstructors)).toBe(\"HESPANHA J P, JOHN S\");\n  });\n  test(\"formatLocation null test\", () => {\n    expect(formatLocation(null)).toBe(\"\");\n  });\n\n  test(\"formatDays null test\", () => {\n    expect(formatDays(null)).toBe(\"\");\n  });\n\n  test(\"formatTime null test\", () => {\n    expect(formatTime(null)).toBe(\"\");\n  });\n\n  test(\"formatInstructors null test\", () => {\n    expect(formatInstructors(null)).toBe(\"\");\n  });\n\n  test(\"formatInfoLink test\", () => {\n    expect(formatInfoLink(oneSection[0])).toBe(\"/coursedetails/20221/12583\");\n  });\n\n  test(\"renderInfoLink test\", () => {\n    const view = renderInfoLink({\n      cell: { value: \"/coursedetails/20221/12583\" },\n    });\n    expect(view.props.children.props.style.color).toBe(\"white\");\n    expect(view.props.children.props.href).toBe(\"/coursedetails/20221/12583\");\n  });\n});\n"},"src/tests/components/SectionsInstructorTableBase.test.js":{"tests":[{"id":"175","name":"SectionsInstructorTableBase tests renders an empty table without crashing","location":{"start":{"column":4,"line":16}}}],"source":"import { render } from \"@testing-library/react\";\nimport SectionsInstructorTableBase from \"main/components/SectionsInstructorTableBase\";\n\ndescribe(\"Sectio
